atewiki.net translatewiki.net] if you wish to contribute to the generic MediaWiki localisation.\";'),(_binary 'en',_binary 'messages:allowemail',_binary 's:32:\"en:Allow other users to email me\";'),(_binary 'en',_binary 'messages:allpages',_binary 's:12:\"en:All pages\";'),(_binary 'en',_binary 'messages:allpages-bad-ns',_binary 's:45:\"en:{{SITENAME}} does not have namespace \"$1\".\";'),(_binary 'en',_binary 'messages:allpages-hide-redirects',_binary 's:17:\"en:Hide redirects\";'),(_binary 'en',_binary 'messages:allpages-summary',_binary 's:3:\"en:\";'),(_binary 'en',_binary 'messages:allpagesbadtitle',_binary 's:151:\"en:The given page title was invalid or had an inter-language or inter-wiki prefix.\nIt may contain one or more characters that cannot be used in titles.\";'),(_binary 'en',_binary 'messages:allpagesfrom',_binary 's:29:\"en:Display pages starting at:\";'),(_binary 'en',_binary 'messages:allpagesprefix',_binary 's:29:\"en:Display pages with prefix:\";'),(_binary 'en',_binary 'messages:allpagessubmit',_binary 's:5:\"en:Go\";'),(_binary 'en',_binary 'messages:allpagesto',_binary 's:27:\"en:Display pages ending at:\";'),(_binary 'en',_binary 'messages:alreadyrolled',_binary 's:359:\"en:Cannot rollback the last edit of [[:$1]] by [[User:$2|$2]] ([[User talk:$2|talk]]{{int:pipe-separator}}[[Special:Contributions/$2|{{int:contribslink}}]]).\nSomeone else has edited or rolled back the page already.\n\nThe last edit to the page was by [[User:$3|$3]] ([[User talk:$3|talk]]{{int:pipe-separator}}[[Special:Contributions/$3|{{int:contribslink}}]]).\";'),(_binary 'en',_binary 'messages:ancientpages',_binary 's:15:\"en:Oldest pages\";'),(_binary 'en',_binary 'messages:ancientpages-summary',_binary 's:3:\"en:\";'),(_binary 'en',_binary 'messages:and',_binary 's:11:\"en:&#32;and\";'),(_binary 'en',_binary 'messages:anoncontribs',_binary 's:16:\"en:Contributions\";'),(_binary 'en',_binary 'messages:anoneditwarning',_binary 's:270:\"en:<strong>Warning:</strong> You are not logged in. Your IP address will be publicly visible if you make any edits. If you <strong>[$1 log in]</strong> or <strong>[$2 create an account]</strong>, your edits will be attributed to your username, along with other benefits.\";'),(_binary 'en',_binary 'messages:anonnotice',_binary 's:4:\"en:-\";'),(_binary 'en',_binary 'messages:anononlyblock',_binary 's:13:\"en:anon. only\";'),(_binary 'en',_binary 'messages:anonpreviewwarning',_binary 's:102:\"en:<em>You are not logged in. Publishing will record your IP address in this page\'s edit history.</em>\";'),(_binary 'en',_binary 'messages:anontalk',_binary 's:7:\"en:Talk\";'),(_binary 'en',_binary 'messages:anontalkpagetext',_binary 's:472:\"en:----\n<em>This is the discussion page for an anonymous user who has not created an account yet, or who does not use it.</em>\nWe therefore have to use the numerical IP address to identify them.\nSuch an IP address can be shared by several users.\nIf you are an anonymous user and feel that irrelevant comments have been directed at you, please [[Special:CreateAccount|create an account]] or [[Special:UserLogin|log in]] to avoid future confusion with other anonymous users.\";'),(_binary 'en',_binary 'messages:anonuser',_binary 's:33:\"en:{{SITENAME}} anonymous user $1\";'),(_binary 'en',_binary 'messages:anonusers',_binary 's:53:\"en:{{SITENAME}} anonymous {{PLURAL:$2|user|users}} $1\";'),(_binary 'en',_binary 'messages:anonymous',_binary 's:53:\"en:Anonymous {{PLURAL:$1|user|users}} of {{SITENAME}}\";'),(_binary 'en',_binary 'messages:api-clientside-error-aborted',_binary 's:27:\"en:The request was aborted.\";'),(_binary 'en',_binary 'messages:api-clientside-error-http',_binary 's:34:\"en:Server returned error: HTTP $1.\";'),(_binary 'en',_binary 'messages:api-clientside-error-invalidresponse',_binary 's:32:\"en:Invalid response from server.\";'),(_binary 'en',_binary 'messages:api-clientside-error-noconnect',_binary 's:99:\"en:Could not connect to the server. Make sure you have a working internet connection and try again.\";'),(_binary 'en',_binary 'messages:api-clientside-error-timeout',_binary 's:55:\"en:The server did not respond within the expected time.\";'),(_binary 'en',_binary 'messages:api-credits',_binary 's:370:\"en:API developers:\n* Yuri Astrakhan (creator, lead developer Sep 2006–Sep 2007)\n* Roan Kattouw (lead developer Sep 2007–2009)\n* Victor Vasiliev\n* Bryan Tong Minh\n* Sam Reed\n* Brad Jorsch (lead developer 2013–2020)\n\nPlease send your comments, suggestions and questions to mediawiki-api@lists.wikimedia.org\nor file a bug report at https://phabricator.wikimedia.org/.\";'),(_binary 'en',_binary 'messages:api-credits-header',_binary 's:10:\"en:Credits\";'),(_binary 'en',_binary 'messages:api-error-badtoken',_binary 's:29:\"en:Internal error: Bad token.\";'),(_binary 'en',_binary 'messages:api-error-emptypage',_binary 's:44:\"en:Creating new, empty pages is not allowed.\";'),(_binary 'en',_binary 'messages:api-error-publishfailed',_binary 's:59:\"en:Internal error: Server failed to publish temporary file.\";'),(_binary 'en',_binary 'messages:api-error-stashfailed',_binary 's:57:\"en:Internal error: Server failed to store temporary file.\";'),(_binary 'en',_binary 'messages:api-error-unknown-warning',_binary 's:25:\"en:Unknown warning: \"$1\".\";'),(_binary 'en',_binary 'messages:api-error-unknownerror',_binary 's:23:\"en:Unknown error: \"$1\".\";'),(_binary 'en',_binary 'messages:api-exception-trace',_binary 's:18:\"en:$1 at $2($3)\n$4\";'),(_binary 'en',_binary 'messages:api-feed-error-title',_binary 's:13:\"en:Error ($1)\";'),(_binary 'en',_binary 'messages:api-format-prettyprint-header',_binary 's:394:\"en:This is the HTML representation of the $1 format. HTML is good for debugging, but is unsuitable for application use.\n\nSpecify the <var>format</var> parameter to change the output format. To see the non-HTML representation of the $1 format, set <kbd>format=$2</kbd>.\n\nSee the [[mw:Special:MyLanguage/API|complete documentation]], or the [[Special:ApiHelp/main|API help]] for more information.\";'),(_binary 'en',_binary 'messages:api-format-prettyprint-header-hyperlinked',_binary 's:380:\"en:This is the HTML representation of the $1 format. HTML is good for debugging, but is unsuitable for application use.\n\nSpecify the <var>format</var> parameter to change the output format. To see the non-HTML representation of the $1 format, set [$3 <kbd>format=$2</kbd>].\n\nSee the [[mw:API|complete documentation]], or the [[Special:ApiHelp/main|API help]] for more information.\";'),(_binary 'en',_binary 'messages:api-format-prettyprint-header-only-html',_binary 's:222:\"en:This is an HTML representation intended for debugging, and is unsuitable for application use.\n\nSee the [[mw:Special:MyLanguage/API|complete documentation]], or the [[Special:ApiHelp/main|API help]] for more information.\";'),(_binary 'en',_binary 'messages:api-format-prettyprint-status',_binary 's:58:\"en:This response would be returned with HTTP status $1 $2.\";'),(_binary 'en',_binary 'messages:api-format-title',_binary 's:23:\"en:MediaWiki API result\";'),(_binary 'en',_binary 'messages:api-help-authmanager-general-usage',_binary 's:1254:\"en:The general procedure to use this module is:\n# Fetch the fields available from <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$4</kbd>, and a <kbd>$5</kbd> token from <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd>.\n# Present the fields to the user, and obtain their submission.\n# Post to this module, supplying <var>$1returnurl</var> and any relevant fields.\n# Check the <samp>status</samp> in the response.\n#* If you received <samp>PASS</samp> or <samp>FAIL</samp>, you\'re done. The operation either succeeded or it didn\'t.\n#* If you received <samp>UI</samp>, present the new fields to the user and obtain their submission. Then post to this module with <var>$1continue</var> and the relevant fields set, and repeat step 4.\n#* If you received <samp>REDIRECT</samp>, direct the user to the <samp>redirecttarget</samp> and wait for the return to <var>$1returnurl</var>. Then post to this module with <var>$1continue</var> and any fields passed to the return URL, and repeat step 4.\n#* If you received <samp>RESTART</samp>, that means the authentication worked but we don\'t have a linked user account. You might treat this as <samp>UI</samp> or as <samp>FAIL</samp>.\";'),(_binary 'en',_binary 'messages:api-help-authmanagerhelper-additional-params',_binary 's:344:\"en:This module accepts additional parameters depending on the available authentication requests. Use <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$1</kbd> (or a previous response from this module, if applicable) to determine the requests available and the fields that they use.\";'),(_binary 'en',_binary 'messages:api-help-authmanagerhelper-continue',_binary 's:152:\"en:This request is a continuation after an earlier <samp>UI</samp> or <samp>REDIRECT</samp> response. Either this or <var>$1returnurl</var> is required.\";'),(_binary 'en',_binary 'messages:api-help-authmanagerhelper-mergerequestfields',_binary 's:74:\"en:Merge field information for all authentication requests into one array.\";'),(_binary 'en',_binary 'messages:api-help-authmanagerhelper-messageformat',_binary 's:40:\"en:Format to use for returning messages.\";'),(_binary 'en',_binary 'messages:api-help-authmanagerhelper-preservestate',_binary 's:68:\"en:Preserve state from a previous failed login attempt, if possible.\";'),(_binary 'en',_binary 'messages:api-help-authmanagerhelper-request',_binary 's:194:\"en:Use this authentication request, by the <samp>id</samp> returned from <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$1</kbd>.\";'),(_binary 'en',_binary 'messages:api-help-authmanagerhelper-requests',_binary 's:246:\"en:Only use these authentication requests, by the <samp>id</samp> returned from <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$1</kbd> or from a previous response from this module.\";'),(_binary 'en',_binary 'messages:api-help-authmanagerhelper-returnurl',_binary 's:517:\"en:Return URL for third-party authentication flows, must be absolute. Either this or <var>$1continue</var> is required.\n\nUpon receiving a <samp>REDIRECT</samp> response, you will typically open a browser or web view to the specified <samp>redirecttarget</samp> URL for a third-party authentication flow. When that completes, the third party will send the browser or web view to this URL. You should extract any query or POST parameters from the URL and pass them as a <var>$1continue</var> request to this API module.\";'),(_binary 'en',_binary 'messages:api-help-datatype-boolean',_binary 's:171:\"en:Boolean parameters work like HTML checkboxes: if the parameter is specified, regardless of value, it is considered true. For a false value, omit the parameter entirely.\";'),(_binary 'en',_binary 'messages:api-help-datatype-expiry',_binary 's:237:\"en:Expiry values may be relative (e.g. <kbd>5 months</kbd> or <kbd>2 weeks</kbd>) or absolute (e.g. <kbd>2014-09-18T12:34:56Z</kbd>). For no expiry, use <kbd>infinite</kbd>, <kbd>indefinite</kbd>, <kbd>infinity</kbd> or <kbd>never</kbd>.\";'),(_binary 'en',_binary 'messages:api-help-datatype-timestamp',_binary 's:391:\"en:Timestamps may be specified in several formats, see [[mw:Special:MyLanguage/Timestamp|the Timestamp library input formats documented on mediawiki.org]] for details. ISO 8601 date and time is recommended: <kbd><var>2001</var>-<var>01</var>-<var>15</var>T<var>14</var>:<var>56</var>:<var>00</var>Z</kbd>. Additionally, the string <kbd>now</kbd> may be used to specify the current timestamp.\";'),(_binary 'en',_binary 'messages:api-help-datatypes-header',_binary 's:13:\"en:Data types\";'),(_binary 'en',_binary 'messages:api-help-datatypes-top',_binary 's:619:\"en:Input to MediaWiki should be NFC-normalized UTF-8. MediaWiki may attempt to convert other input, but this may cause some operations (such as [[Special:ApiHelp/edit|edits]] with MD5 checks) to fail.\n\nParameters that take multiple values are normally submitted with the values separated using the pipe character, e.g. <kbd>param=value1|value2</kbd> or <kbd>param=value1%7Cvalue2</kbd>. If a value must contain the pipe character, use U+001F (Unit Separator) as the separator \'\'and\'\' prefix the value with U+001F, e.g. <kbd>param=%1Fvalue1%1Fvalue2</kbd>.\n\nSome parameter types in API requests need further explanation:\";'),(_binary 'en',_binary 'messages:api-help-examples',_binary 's:34:\"en:{{PLURAL:$1|Example|Examples}}:\";'),(_binary 'en',_binary 'messages:api-help-flag-deprecated',_binary 's:29:\"en:This module is deprecated.\";'),(_binary 'en',_binary 'messages:api-help-flag-generator',_binary 's:42:\"en:This module can be used as a generator.\";'),(_binary 'en',_binary 'messages:api-help-flag-internal',_binary 's:124:\"en:<strong>This module is internal or unstable, and you should not use it.</strong> Its operation may change without notice.\";'),(_binary 'en',_binary 'messages:api-help-flag-mustbeposted',_binary 's:42:\"en:This module only accepts POST requests.\";'),(_binary 'en',_binary 'messages:api-help-flag-readrights',_binary 's:36:\"en:This module requires read rights.\";'),(_binary 'en',_binary 'messages:api-help-flag-writerights',_binary 's:37:\"en:This module requires write rights.\";'),(_binary 'en',_binary 'messages:api-help-flags',_binary 's:3:\"en:\";'),(_binary 'en',_binary 'messages:api-help-help-urls',_binary 's:3:\"en:\";'),(_binary 'en',_binary 'messages:api-help-lead',_binary 's:155:\"en:This is an auto-generated MediaWiki API documentation page.\n\nDocumentation and examples: https://www.mediawiki.org/wiki/Special:MyLanguage/API:Main_pag