ocreate',_binary 's:44:\"en:Throw an error if the page doesn\'t exist.\";'),(_binary 'en',_binary 'messages:apihelp-edit-param-notminor',_binary 's:103:\"en:Do not mark this edit as a minor edit even if the \"{{int:tog-minordefault}}\" user preference is set.\";'),(_binary 'en',_binary 'messages:apihelp-edit-param-pageid',_binary 's:80:\"en:Page ID of the page to edit. Cannot be used together with <var>$1title</var>.\";'),(_binary 'en',_binary 'messages:apihelp-edit-param-prependtext',_binary 's:75:\"en:Add this text to the beginning of the page or section. Overrides $1text.\";'),(_binary 'en',_binary 'messages:apihelp-edit-param-recreate',_binary 's:74:\"en:Override any errors about the page having been deleted in the meantime.\";'),(_binary 'en',_binary 'messages:apihelp-edit-param-redirect',_binary 's:35:\"en:Automatically resolve redirects.\";'),(_binary 'en',_binary 'messages:apihelp-edit-param-returnto',_binary 's:256:\"en:Page title. If saving the edit created a temporary account, the API may respond with an URL that the client should visit to complete logging in. If this parameter is provided, the URL will redirect to the given page, instead of the page that was edited.\";'),(_binary 'en',_binary 'messages:apihelp-edit-param-returntoanchor',_binary 's:265:\"en:URL fragment (with leading <kbd>#</kbd>). If saving the edit created a temporary account, the API may respond with an URL that the client should visit to complete logging in. If this parameter is provided, the URL will redirect to a page with the given fragment.\";'),(_binary 'en',_binary 'messages:apihelp-edit-param-returntoquery',_binary 's:281:\"en:URL query parameters (with leading <kbd>?</kbd>). If saving the edit created a temporary account, the API may respond with an URL that the client should visit to complete logging in. If this parameter is provided, the URL will redirect to a page with the given query parameters.\";'),(_binary 'en',_binary 'messages:apihelp-edit-param-section',_binary 's:14