atch',_binary 's:53:\"en:Remove the page from the current user\'s watchlist.\";'),(_binary 'en',_binary 'messages:apihelp-edit-param-watch',_binary 's:48:\"en:Add the page to the current user\'s watchlist.\";'),(_binary 'en',_binary 'messages:apihelp-edit-param-watchlist',_binary 's:140:\"en:Unconditionally add or remove the page from the current user\'s watchlist, use preferences (ignored for bot users) or do not change watch.\";'),(_binary 'en',_binary 'messages:apihelp-edit-param-watchlistexpiry',_binary 's:98:\"en:Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.\";'),(_binary 'en',_binary 'messages:apihelp-edit-summary',_binary 's:25:\"en:Create and edit pages.\";'),(_binary 'en',_binary 'messages:apihelp-editcheckreferenceurl-param-url',_binary 's:16:\"en:URL to check.\";'),(_binary 'en',_binary 'messages:apihelp-editcheckreferenceurl-summary',_binary 's:52:\"en:Check the status of a URL for use as a reference.\";'),(_binary 'en',_binary 'messages:apihelp-emailuser-example-email',_binary 's:83:\"en:Send an email to the user <kbd>WikiSysop</kbd> with the text <kbd>Content</kbd>.\";'),(_binary 'en',_binary 'messages:apihelp-emailuser-param-ccme',_binary 's:34:\"en:Send a copy of this mail to me.\";'),(_binary 'en',_binary 'messages:apihelp-emailuser-param-subject',_binary 's:18:\"en:Subject header.\";'),(_binary 'en',_binary 'messages:apihelp-emailuser-param-target',_binary 's:29:\"en:User to send the email to.\";'),(_binary 'en',_binary 'messages:apihelp-emailuser-param-text',_binary 's:14:\"en:Email body.\";'),(_binary 'en',_binary 'messages:apihelp-emailuser-summary',_binary 's:16:\"en:Email a user.\";'),(_binary 'en',_binary 'messages:apihelp-expandtemplates-example-simple',_binary 's:71:\"en:Expand the wikitext <kbd><nowiki>{{Project:Sandbox}}</nowiki></kbd>.\";'),(_binary 'en',_binary 'messages:apihelp-expandtemplates-param-generatexml',_binary 's:58:\"en:Generate XML parse tree (replaced by $1prop=parsetree).\