),(_binary 'en',_binary 'messages:apihelp-help-example-recursive',_binary 's:24:\"en:All help in one page.\";'),(_binary 'en',_binary 'messages:apihelp-help-example-submodules',_binary 's:59:\"en:Help for <kbd>action=query</kbd> and all its submodules.\";'),(_binary 'en',_binary 'messages:apihelp-help-param-helpformat',_binary 's:29:\"en:Format of the help output.\";'),(_binary 'en',_binary 'messages:apihelp-help-param-modules',_binary 's:162:\"en:Modules to display help for (values of the <var>action</var> and <var>format</var> parameters, or <kbd>main</kbd>). Can specify submodules with a <kbd>+</kbd>.\";'),(_binary 'en',_binary 'messages:apihelp-help-param-recursivesubmodules',_binary 's:43:\"en:Include help for submodules recursively.\";'),(_binary 'en',_binary 'messages:apihelp-help-param-submodules',_binary 's:51:\"en:Include help for submodules of the named module.\";'),(_binary 'en',_binary 'messages:apihelp-help-param-toc',_binary 's:50:\"en:Include a table of contents in the HTML output.\";'),(_binary 'en',_binary 'messages:apihelp-help-param-wrap',_binary 's:56:\"en:Wrap the output in a standard API response structure.\";'),(_binary 'en',_binary 'messages:apihelp-help-summary',_binary 's:42:\"en:Display help for the specified modules.\";'),(_binary 'en',_binary 'messages:apihelp-imagerotate-example-generator',_binary 's:75:\"en:Rotate all images in <kbd>Category:Flip</kbd> by <kbd>180</kbd> degrees.\";'),(_binary 'en',_binary 'messages:apihelp-imagerotate-example-simple',_binary 's:63:\"en:Rotate <kbd>File:Example.png</kbd> by <kbd>90</kbd> degrees.\";'),(_binary 'en',_binary 'messages:apihelp-imagerotate-param-rotation',_binary 's:37:\"en:Degrees to rotate image clockwise.\";'),(_binary 'en',_binary 'messages:apihelp-imagerotate-param-tags',_binary 's:48:\"en:Tags to apply to the entry in the upload log.\";'),(_binary 'en',_binary 'messages:apihelp-imagerotate-summary',_binary 's:29:\"en:Rotate one or more images.\";'),(_binary 'en',_binary 'messages:api