elp-import-param-xml',_binary 's:21:\"en:Uploaded XML file.\";'),(_binary 'en',_binary 'messages:apihelp-import-summary',_binary 's:56:\"en:Import a page from another wiki, or from an XML file.\";'),(_binary 'en',_binary 'messages:apihelp-json-param-ascii',_binary 's:129:\"en:If specified, encodes all non-ASCII using hexadecimal escape sequences. Default when <var>formatversion</var> is <kbd>1</kbd>.\";'),(_binary 'en',_binary 'messages:apihelp-json-param-callback',_binary 's:116:\"en:If specified, wraps the output into a given function call. For safety, all user-specific data will be restricted.\";'),(_binary 'en',_binary 'messages:apihelp-json-param-formatversion',_binary 's:20:\"en:Output formatting\";'),(_binary 'en',_binary 'messages:apihelp-json-param-utf8',_binary 's:193:\"en:If specified, encodes most (but not all) non-ASCII characters as UTF-8 instead of replacing them with hexadecimal escape sequences. Default when <var>formatversion</var> is not <kbd>1</kbd>.\";'),(_binary 'en',_binary 'messages:apihelp-json-paramvalue-formatversion-1',_binary 's:97:\"en:Backwards-compatible format (XML-style booleans, <samp>*</samp> keys for content nodes, etc.).\";'),(_binary 'en',_binary 'messages:apihelp-json-paramvalue-formatversion-2',_binary 's:17:\"en:Modern format.\";'),(_binary 'en',_binary 'messages:apihelp-json-paramvalue-formatversion-latest',_binary 's:78:\"en:Use the latest format (currently <kbd>2</kbd>), may change without warning.\";'),(_binary 'en',_binary 'messages:apihelp-json-summary',_binary 's:30:\"en:Output data in JSON format.\";'),(_binary 'en',_binary 'messages:apihelp-jsonfm-summary',_binary 's:53:\"en:Output data in JSON format (pretty-print in HTML).\";'),(_binary 'en',_binary 'messages:apihelp-link',_binary 's:28:\"en:[[Special:ApiHelp/$1|$2]]\";'),(_binary 'en',_binary 'messages:apihelp-linkaccount-example-link',_binary 's:70:\"en:Start the process of linking to an account from <kbd>Example</kbd>.\";'),(_binary 'en',_binary 'messages:apihelp-linkaccount-summary',_binary 's:67:\"en:Link an account from a third-party provider to the current user.\";'),(_binary 'en',_binary 'messages:apihelp-login-example-login',_binary 's:10:\"en:Log in.\";'),(_binary 'en',_binary 'messages:apihelp-login-extended-description',_binary 's:256:\"en:This action should only be used in combination with [[Special:BotPasswords]]; use for main-account login is deprecated and may fail without warning. To safely log in to the main account, use <kbd>[[Special:ApiHelp/clientlogin|action=clientlogin]]</kbd>.\";'),(_binary 'en',_binary 'messages:apihelp-login-extended-description-nobotpasswords',_binary 's:143:\"en:This action is deprecated and may fail without warning. To safely log in, use <kbd>[[Special:ApiHelp/clientlogin|action=clientlogin]]</kbd>.\";'),(_binary 'en',_binary 'messages:apihelp-login-param-domain',_binary 's:21:\"en:Domain (optional).\";'),(_binary 'en',_binary 'messages:apihelp-login-param-name',_binary 's:12:\"en:Username.\";'),(_binary 'en',_binary 'messages:apihelp-login-param-password',_binary 's:12:\"en:Password.\";'),(_binary 'en',_binary 'messages:apihelp-login-param-token',_binary 's:41:\"en:Login token obtained in first request.\";'),(_binary 'en',_binary 'messages:apihelp-login-summary',_binary 's:41:\"en:Log in and get authentication cookies.\";'),(_binary 'en',_binary 'messages:apihelp-logout-example-logout',_binary 's:28:\"en:Log the current user out.\";'),(_binary 'en',_binary 'messages:apihelp-logout-param-checkuserclienthints',_binary 's:85:\"en:Client hints data supplied alongside requests to ApiLogout. For internal use only.\";'),(_binary 'en',_binary 'messages:apihelp-logout-summary',_binary 's:34:\"en:Log out and clear session data.\";'),(_binary 'en',_binary 'messages:apihelp-main-extended-description',_binary 's:1342:\"en:<div class=\"hlist plainlinks api-main-links\">\n* [[mw:Special:MyLanguage/API:Main_page|Documentation]]\n* [[mw:Special:MyLanguage/API:Etiquette|Etiquette & usage guidelines]]\n* [[mw:Special:MyLanguage/API:FAQ|FAQ]]\n* [https://lists.wikimedia.org/postorius/lists/mediawiki-api.lists.wikimedia.org/ Mailing list]\n* [https://lists.wikimedia.org/postorius/lists/mediawiki-api-announce.lists.wikimedia.org/ API Announcements]\n* [https://phabricator.wikimedia.org/maniphest/query/GebfyV4uCaLd/#R Bugs & requests]\n</div>\n<strong>Status:</strong> The MediaWiki API is a mature and stable interface that is actively supported and improved. While we try to avoid it, we may occasionally need to make breaking changes; subscribe to [https://lists.wikimedia.org/hyperkitty/list/mediawiki-api-announce@lists.wikimedia.org/ the mediawiki-api-announce mailing list] for notice of updates.\n\n<strong>Erroneous requests:</strong> When erroneous requests are sent to the API, an HTTP header will be sent with the key \"MediaWiki-API-Error\" and then both the value of the header and the error code sent back will be set to the same value. For more information see [[mw:Special:MyLanguage/API:Errors_and_warnings|API: Errors and warnings]].\n\n<p class=\"mw-apisandbox-link\"><strong>Testing:</strong> For ease of testing API requests, see [[Special:ApiSandbox]].</p>\";'),(_binary 'en',_binary 'messages:apihelp-main-param-action',_binary 's:27:\"en:Which action to perform.\";'),(_binary 'en',_binary 'messages:apihelp-main-param-assert',_binary 's:199:\"en:Verify that the user is logged in (including possibly as a temporary user) if set to <kbd>user</kbd>, <em>not</em> logged in if set to <kbd>anon</kbd>, or has the bot user right if <kbd>bot</kbd>.\";'),(_binary 'en',_binary 'messages:apihelp-main-param-assertuser',_binary 's:45:\"en:Verify the current user is the named user.\";'),(_binary 'en',_binary 'messages:apihelp-main-param-crossorigin',_binary 's:542:\"en:When accessing the API using a cross-domain AJAX request (CORS) and using a session provider that is safe against cross-site request forgery (CSRF) attacks (such as OAuth), use this instead of <code>origin=*</code> to make the request authenticated (i.e., not logged out). This must be included in any pre-flight request, and therefore must be part of the request URI (not the POST body).\n\nNote that most session providers, including standard cookie-based sessions, do not support authenticated CORS and cannot be used with this parameter.\";'),(_binary 'en',_binary 'messages:apihelp-main-param-curtimestamp',_binary 's:47:\"en:Include the current timestamp in the result.\";'),(_binary 'en',_binary 'messages:apihelp-main-param-errorformat',_binary 's:50:\"en:Format to use for warning and error text output\";'),(_binary 'en',_binary 'messages:apihelp-main-param-errorlang',_binary 's:311:\"en:Language to use for warnings and errors. <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo&siprop=languages]]</kbd> returns a list of language codes. Specify <kbd>content</kbd> to use this wiki\'s content language or <kbd>uselang</kbd> to use the same value as the <var>uselang</var> parameter.\";'),(_binary 'en',_binary 'messages:apihelp-main-param-errorsuselocal',_binary 's:98:\"en:If given, error texts will use locally-customized messages from the {{ns:MediaWiki}} namespace.\";'),(_binary 'en',_binary 'messages:apihelp-main-param-format',_binary 's:28:\"en:The format of the output.\";'),(_binary 'en',_binary 'messages:apihelp-main-param-maxage',_binary 's:104:\"en:Set the <code>max-age</code> HTTP cache control header to this many seconds. Errors are never cached.\";'),(_binary 'en',_binary 'messages:apihelp-main-param-maxlag',_binary 's:491:\"en:Maximum lag can be used when MediaWiki is installed on a database replicated cluster. To save actions causing any more site replication lag, this parameter can make the client wait until the replication lag is less than the specified value. In case of excessive lag, error code <samp>maxlag</samp> is returned with a message like <samp>Waiting for $host: $lag seconds lagged</samp>.<br />See [[mw:Special:MyLanguage/Manual:Maxlag_parameter|Manual: Maxlag parameter]] for more information.\";'),(_binary 'en',_binary 'messages:apihelp-main-param-origin',_binary 's:1008:\"en:When accessing the API using a cross-domain AJAX request (CORS), set this to the originating domain. This must be included in any pre-flight request, and therefore must be part of the request URI (not the POST body).\n\nFor authenticated requests, this must match one of the origins in the <code>Origin</code> header exactly, so it has to be set to something like <kbd>https://en.wikipedia.org</kbd> or <kbd>https://meta.wikimedia.org</kbd>. If this parameter does not match the <code>Origin</code> header, a 403 response will be returned. If this parameter matches the <code>Origin</code> header and the origin is allowed, the <code>Access-Control-Allow-Origin</code> and <code>Access-Control-Allow-Credentials</code> headers will be set.\n\nFor non-authenticated requests, specify the value <kbd>*</kbd>. This will cause the <code>Access-Control-Allow-Origin</code> header to be set, but <code>Access-Control-Allow-Credentials</code> will be <code>false</code> and all user-specific data will be restricted.\";'),(_binary 'en',_binary 'messages:apihelp-main-param-requestid',_binary 's:94:\"en:Any value given here will be included in the response. May be used to distinguish requests.\";'),(_binary 'en',_binary 'messages:apihelp-main-param-responselanginfo',_binary 's:92:\"en:Include the languages used for <var>uselang</var> and <var>errorlang</var> in the result.\";'),(_binary 'en',_binary 'messages:apihelp-main-param-servedby',_binary 's:63:\"en:Include the hostname that served the request in the results.\";'),(_binary 'en',_binary 'messages:apihelp-main-param-smaxage',_binary 's:105:\"en:Set the <code>s-maxage</code> HTTP cache control header to this many seconds. Errors are never cached.\";'),(_binary 'en',_binary 'messages:apihelp-main-param-uselang',_binary 's:305:\"en:Language to use for message translations. <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo&siprop=languages]]</kbd> returns a list of language codes. You can specify <kbd>user</kbd> to use the current user\'s language preference or <kbd>content</kbd> to use this wiki\'s content language.\";'),(_binary 'en',_binary 'messages:apihelp-main-param-variant',_binary 's:88:\"en:Variant of the language. Only works if the base language supports variant conversion.\";'),(_binary 'en',_binary 'messages:apihelp-main-paramvalue-errorformat-bc',_binary 's:103:\"en:Format used prior to MediaWiki 1.29. <var>errorlang</var> and <var>errorsuselocal</var> are ignored.\";'),(_binary 'en',_binary 'messages:apihelp-main-paramvalue-errorformat-html',_binary 's:7:\"en:HTML\";'),(_binary 'en',_binary 'messages:apihelp-main-paramvalue-errorformat-none',_binary 's:40:\"en:No text output, only the error codes.\";'),(_binary 'en',_binary 'messages:apihelp-main-paramvalue-errorformat-plaintext',_binary 's:57:\"en:Wikitext with HTML tags removed and entities replaced.\";'),(_binary 'en',_binary 'messages:apihelp-main-paramvalue-errorformat-raw',_binary 's:30:\"en:Message key and parameters.\";'),(_binary 'en',_binary 'messages:apihelp-main-paramvalue-errorformat-wikitext',_binary 's:21:\"en:Unparsed wikitext.\";'),(_binary 'en',_binary 'messages:apihelp-main-summary',_binary 's:3:\"en:\";'),(_binary 'en',_binary 'messages:apihelp-managetags-example-activate',_binary 's:93:\"en:Activate a tag named <kbd>spam</kbd> with the reason <kbd>For use in edit patrolling</kbd>\";'),(_binary 'en',_binary 'messages:apihelp-managetags-example-create',_binary 's:91:\"en:Create a tag named <kbd>spam</kbd> with the reason <kbd>For use in edit patrolling</kbd>\";'),(_binary 'en',_binary 'messages:apihelp-managetags-example-deactivate',_binary 's:87:\"en:Deactivate a tag named <kbd>spam</kbd> with the reason <kbd>No longer required</kbd>\";'),(_binary 'en',_binary 'messages:apihelp-managetags-example-delete',_binary 's:74:\"en:Delete the <kbd>vandlaism</kbd> tag with the reason <kbd>Misspelt</kbd>\";'),(_binary 'en',_binary 'messages:apihelp-managetags-param-ignorewarnings',_binary 's:71:\"en:Whether to ignore any warnings that are issued during the operation.\";'),(_binary 'en',_binary 'messages:apihelp-managetags-param-operation',_binary 's:30:\"en:Which operation to perform:\";'),(_binary 'en',_binary 'messages:apihelp-managetags-param-reason',_binary 's:81:\"en:An optional reason for creating, deleting, activating or deactivating the tag.\";'),(_binary 'en',_binary 'messages:apihelp-managetags-param-tag',_binary 's:280:\"en:Tag to create, delete, activate or deactivate. For tag creation, the tag must not exist. For tag deletion, the tag must exist. For tag activation, the tag must exist and not be in use by an extension. For tag deactivation, the tag must be currently active and manually defined.\";'),(_binary 'en',_binary 'messages:apihelp-managetags-param-tags',_binary 's:63:\"en:Change tags to apply to the entry in the tag management log.\";'),(_binary 'en',_binary 'messages:apihelp-managetags-paramvalue-operation-activate',_binary 's:62:\"en:Activate a change tag, allowing users to apply it manually.\";'),(_binary 'en',_binary 'messages:apihelp-managetags-paramvalue-operation-create',_binary 's:42:\"en:Create a new change tag for manual use.\";'),(_binary 'en',_binary 'messages:apihelp-managetags-paramvalue-operation-deactivate',_binary 's:71:\"en:Deactivate a change tag, preventing users from applying it manually.\";'),(_binary 'en',_binary 'messages:apihelp-managetags-paramvalue-operation-delete',_binary 's:147:\"en:Remove a change tag from the database, including removing the tag from all revisions, recent change entries and log entries on which it is used.\";'),(_binary 'en',_binary 'messages:apihelp-managetags-summary',_binary 's:52:\"en:Perform management tasks relating to change tags.\";'),(_binary 'en',_binary 'messages:apihelp-mergehistory-example-merge',_binary 's:74:\"en:Merge the entire history of <kbd>Oldpage</kbd> into <kbd>Newpage</kbd>.\";'),(_binary 'en',_binary 'messages:apihelp-mergehistory-example-merge-timestamp',_binary 's:119:\"en:Merge the page revisions of <kbd>Oldpage</kbd> dating up to <kbd>2015-12-31T04:37:41Z</kbd> into <kbd>Newpage</kbd>.\";'),(_binary 'en',_binary 'messages:apihelp-mergehistory-param-from',_binary 's:105:\"en:Title of the page from which history will be merged. Cannot be used together with <var>$1fromid</var>.\";'),(_binary 'en',_binary 'messages:apihelp-mergehistory-param-fromid',_binary 's:105:\"en:Page ID of the page from which history will be merged. Cannot be used together with <var>$1from</var>.\";'),(_binary 'en',_binary 'messages:apihelp-mergehistory-param-reason',_binary 's:32:\"en:Reason for the history merge.\";'),(_binary 'en',_binary 'messages:apihelp-mergehistory-param-timestamp',_binary 's:211:\"en:Timestamp up to which revisions will be moved from the source page\'s history to the destination page\'s history. If omitted, the entire page history of the source page will be merged into the destination page.\";'),(_binary 'en',_binary 'messages:apihelp-mergehistory-param-to',_binary 's:101:\"en:Title of the page to which history will be merged. Cannot be used together with <var>$1toid</var>.\";'),(_binary 'en',_binary 'messages:apihelp-mergehistory-param-toid',_binary 's:101:\"en:Page ID of the page to which history will be merged. Cannot be used together with <var>$1to</var>.\";'),(_binary 'en',_binary 'messages:apihelp-mergehistory-summary',_binary 's:24:\"en:Merge page histories.\";'),(_binary 'en',_binary 'messages:apihelp-move-example-move',_binary 's:79:\"en:Move <kbd>Badtitle</kbd> to <kbd>Goodtitle</kbd> without leaving a redirect.\";'),(_binary 'en',_binary 'messages:apihelp-move-param-from',_binary 's:81:\"en:Title of the page to rename. Cannot be used together with <var>$1fromid</var>.\";'),(_binary 'en',_binary 'messages:apihelp-move-param-fromid',_binary 's:81:\"en:Page ID of the page to rename. Cannot be used together with <var>$1from</var>.\";'),(_binary 'en',_binary 'messages:apihelp-move-param-ignorewarnings',_binary 's:23:\"en:Ignore any warnings.\";'),(_binary 'en',_binary 'messages:apihelp-move-param-movesubpages',_binary 's:34:\"en:Rename subpages, if applicable.\";'),(_binary 'en',_binary 'messages:apihelp-move-param-movetalk',_binary 's:38:\"en:Rename the talk page, if it exists.\";'),(_binary 'en',_binary 'messages:apihelp-move-param-noredirect',_binary 's:27:\"en:Don\'t create a redirect.\";'),(_binary 'en',_binary 'messages:apihelp-move-param-reason',_binary 's:25:\"en:Reason for the rename.\";'),(_binary 'en',_binary 'messages:apihelp-move-param-tags',_binary 's:102:\"en:Change tags to apply to the entry in the move log and to the null revision on the destination page.\";'),(_binary 'en',_binary 'messages:apihelp-move-param-to',_binary 's:31:\"en:Title to rename the page to.\";'),(_binary 'en',_binary 'messages:apihelp-move-param-unwatch',_binary 's:70:\"en:Remove the page and the redirect from the current user\'s watchlist.\";'),(_binary 'en',_binary 'messages:apihelp-move-param-watch',_binary 's:65:\"en:Add the page and the redirect to the current user\'s watchlist.\";'),(_binary 'en',_binary 'messages:apihelp-move-param-watchlist',_binary 's:140:\"en:Unconditionally add or remove the page from the current user\'s watchlist, use preferences (ignored for bot users) or do not change watch.\";'),(_binary 'en',_binary 'messages:apihelp-move-param-watchlistexpiry',_binary 's:98:\"en:Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.\";'),(_binary 'en',_binary 'messages:apihelp-move-summary',_binary 's:15:\"en:Move a page.\";'),(_binary 'en',_binary 'messages:apihelp-no-such-module',_binary 's:25:\"en:Module \"$1\" not found.\";'),(_binary 'en',_binary 'messages:apihelp-none-summary',_binary 's:18:\"en:Output nothing.\";'),(_binary 'en',_binary 'messages:apihelp-oathvalidate-example-1',_binary 's:42:\"en:Validate JSON data for the current user\";'),(_binary 'en',_binary 'messages:apihelp-oathvalidate-example-3',_binary 's:49:\"en:Validate JSON data for user <kbd>Example</kbd>\";'),(_binary 'en',_binary 'messages:apihelp-oathvalidate-param-data',_binary 's:96:\"en:JSON encoded data expected by the module currently activated for the user being authenticated\";'),(_binary 'en',_binary 'messages:apihelp-oathvalidate-param-user',_binary 's:60:\"en:User to validate token for. Defaults to the current user.\";'),(_binary 'en',_binary 'messages:apihelp-oathvalidate-summary',_binary 's:53:\"en:Validate a two-factor authentication (OATH) token.\";'),(_binary 'en',_binary 'messages:apihelp-opensearch-example-te',_binary 's:43:\"en:Find pages beginning with <kbd>Te</kbd>.\";'),(_binary 'en',_binary 'messages:apihelp-opensearch-param-format',_binary 's:28:\"en:The format of the output.\";'),(_binary 'en',_binary 'messages:apihelp-opensearch-param-limit',_binary 's:39:\"en:Maximum number of results to return.\";'),(_binary 'en',_binary 'messages:apihelp-opensearch-param-namespace',_binary 's:93:\"en:Namespaces to search. Ignored if <var>$1search</var> begins with a valid namespace prefix.\";'),(_binary 'en',_binary 'messages:apihelp-opensearch-param-redirects',_binary 's:27:\"en:How to handle redirects:\";'),(_binary 'en',_binary 'messages:apihelp-opensearch-param-redirects-append',_binary 's:101:\"en:For historical reasons, the default is \"return\" for $1format=json and \"resolve\" for other formats.\";'),(_binary 'en',_binary 'messages:apihelp-opensearch-param-search',_binary 's:17:\"en:Search string.\";'),(_binary 'en',_binary 'messages:apihelp-opensearch-param-suggest',_binary 's:18:\"en:No longer used.\";'),(_binary 'en',_binary 'messages:apihelp-opensearch-param-warningsaserror',_binary 's:100:\"en:If warnings are raised with <kbd>format=json</kbd>, return an API error instead of ignoring them.\";'),(_binary 'en',_binary 'messages:apihelp-opensearch-paramvalue-redirects-resolve',_binary 's:65:\"en:Return the target page. May return fewer than $1limit results.\";'),(_binary 'en',_binary 'messages:apihelp-opensearch-paramvalue-redirects-return',_binary 's:30:\"en:Return the redirect itself.\";'),(_binary 'en',_binary 'messages:apihelp-opensearch-summary',_binary 's:49:\"en:Search the wiki using the OpenSearch protocol.\";'),(_binary 'en',_binary 'messages:apihelp-options-example-change',_binary 's:63:\"en:Change <kbd>skin</kbd> and <kbd>hideminor</kbd> preferences.\";'),(_binary 'en',_binary 'messages:apihelp-options-example-complex',_binary 's:75:\"en:Reset all preferences, then set <kbd>skin</kbd> and <kbd>nickname</kbd>.\";'),(_binary 'en',_binary 'messages:apihelp-options-example-reset',_binary 's:25:\"en:Reset all preferences.\";'),(_binary 'en',_binary 'messages:apihelp-options-extended-description',_binary 's:186:\"en:Only options which are registered in core or in one of installed extensions, or options with keys prefixed with <code>userjs-</code> (intended to be used by user scripts), can be set.\";'),(_binary 'en',_binary 'messages:apihelp-options-param-change',_binary 's:361:\"en:List of changes, formatted name=value (e.g. skin=vector). If no value is given (not even an equals sign), e.g., optionname|otheroption|..., the option will be reset to its default value. If any value passed contains the pipe character (<kbd>|</kbd>), use the [[Special:ApiHelp/main#main/datatypes|alternative multiple-value separator]] for correct operation.\";'),(_binary 'en',_binary 'messages:apihelp-options-param-global',_binary 's:255:\"en:What to do if the option was set globally using the GlobalPreferences extension.\n\n* <kbd>ignore</kbd>: Do nothing. The option remains with its previous value.\n* <kbd>override</kbd>: Add a local override.\n* <kbd>update</kbd>: Update the option globally.\";'),(_binary 'en',_binary 'messages:apihelp-options-param-optionname',_binary 's:92:\"en:The name of the option that should be set to the value given by <var>$1optionvalue</var>.\";'),(_binary 'en',_binary 'messages:apihelp-options-param-optionvalue',_binary 's:189:\"en:The value for the option specified by <var>$1optionname</var>. When <var>$1optionname</var> is set but <var>$1optionvalue</var> is omitted, the option will be reset to its default value.\";'),(_binary 'en',_binary 'messages:apihelp-options-param-reset',_binary 's:43:\"en:Resets preferences to the site defaults.\";'),(_binary 'en',_binary 'messages:apihelp-options-param-resetkinds',_binary 's:79:\"en:List of types of options to reset when the <var>$1reset</var> option is set.\";'),(_binary 'en',_binary 'messages:apihelp-options-summary',_binary 's:42:\"en:Change preferences of the current user.\";'),(_binary 'en',_binary 'messages:apihelp-paraminfo-example-1',_binary 's:272:\"en:Show info for <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd>, <kbd>[[Special:ApiHelp/jsonfm|format=jsonfm]]</kbd>, <kbd>[[Special:ApiHelp/query+allpages|action=query&list=allpages]]</kbd>, and <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd>.\";'),(_binary 'en',_binary 'messages:apihelp-paraminfo-example-2',_binary 's:85:\"en:Show info for all submodules of <kbd>[[Special:ApiHelp/query|action=query]]</kbd>.\";'),(_binary 'en',_binary 'messages:apihelp-paraminfo-param-formatmodules',_binary 's:104:\"en:List of format module names (value of <var>format</var> parameter). Use <var>$1modules</var> instead.\";'),(_binary 'en',_binary 'messages:apihelp-paraminfo-param-helpformat',_binary 's:26:\"en:Format of help strings.\";'),(_binary 'en',_binary 'messages:apihelp-paraminfo-param-mainmodule',_binary 's:100:\"en:Get information about the main (top-level) module as well. Use <kbd>$1modules=main</kbd> instead.\";'),(_binary 'en',_binary 'messages:apihelp-paraminfo-param-modules',_binary 's:244:\"en:List of module names (values of the <var>action</var> and <var>format</var> parameters, or <kbd>main</kbd>). Can specify submodules with a <kbd>+</kbd>, or all submodules with <kbd>+*</kbd>, or all submodules recursively with <kbd>+**</kbd>.\";'),(_binary 'en',_binary 'messages:apihelp-paraminfo-param-pagesetmodule',_binary 's:84:\"en:Get information about the pageset module (providing titles= and friends) as well.\";'),(_binary 'en',_binary 'messages:apihelp-paraminfo-param-querymodules',_binary 's:180:\"en:List of query module names (value of <var>prop</var>, <var>meta</var> or <var>list</var> parameter). Use <kbd>$1modules=query+foo</kbd> instead of <kbd>$1querymodules=foo</kbd>.\";'),(_binary 'en',_binary 'messages:apihelp-paraminfo-summary',_binary 's:40:\"en:Obtain information about API modules.\";'),(_binary 'en',_binary 'messages:apihelp-parse-example-page',_binary 's:16:\"en:Parse a page.\";'),(_binary 'en',_binary 'messages:apihelp-parse-example-summary',_binary 's:19:\"en:Parse a summary.\";'),(_binary 'en',_binary 'messages:apihelp-parse-example-text',_binary 's:18:\"en:Parse wikitext.\";'),(_binary 'en',_binary 'messages:apihelp-parse-example-texttitle',_binary 's:45:\"en:Parse wikitext, specifying the page title.\";'),(_binary 'en',_binary 'messages:apihelp-parse-extended-description',_binary 's:503:\"en:See the various prop-modules of <kbd>[[Special:ApiHelp/query|action=query]]</kbd> to get information from the current version of a page.\n\nThere are several ways to specify the text to parse:\n# Specify a page or revision, using <var>$1page</var>, <var>$1pageid</var>, or <var>$1oldid</var>.\n# Specify content explicitly, using <var>$1text</var>, <var>$1title</var>, <var>$1revid</var>, and <var>$1contentmodel</var>.\n# Specify only a summary to parse. <var>$1prop</var> should be given an empty value.\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-contentformat',_binary 's:90:\"en:Content serialization format used for the input text. Only valid when used with $1text.\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-contentmodel',_binary 's:162:\"en:Content model of the input text. If omitted, $1title must be specified, and default will be the model of the specified title. Only valid when used with $1text.\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-disableeditsection',_binary 's:50:\"en:Omit edit section links from the parser output.\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-disablelimitreport',_binary 's:71:\"en:Omit the limit report (\"NewPP limit report\") from the parser output.\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-disablepp',_binary 's:47:\"en:Use <var>$1disablelimitreport</var> instead.\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-disablestylededuplication',_binary 's:62:\"en:Do not deduplicate inline stylesheets in the parser output.\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-disabletoc',_binary 's:36:\"en:Omit table of contents in output.\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-effectivelanglinks',_binary 's:93:\"en:Includes language links supplied by extensions (for use with <kbd>$1prop=langlinks</kbd>).\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-generatexml',_binary 's:109:\"en:Generate XML parse tree (requires content model <code>$1</code>; replaced by <kbd>$2prop=parsetree</kbd>).\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-oldid',_binary 's:91:\"en:Parse the content of this revision. Overrides <var>$1page</var> and <var>$1pageid</var>.\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-onlypst',_binary 's:168:\"en:Do a pre-save transform (PST) on the input, but don\'t parse it. Returns the same wikitext, after a PST has been applied. Only valid when used with <var>$1text</var>.\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-page',_binary 's:105:\"en:Parse the content of this page. Cannot be used together with <var>$1text</var> and <var>$1title</var>.\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-pageid',_binary 's:63:\"en:Parse the content of this page. Overrides <var>$1page</var>.\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-parsoid',_binary 's:101:\"en:Generate HTML conforming to the [[mw:Specs/HTML|MediaWiki DOM spec]] using [[mw:Parsoid|Parsoid]].\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-preview',_binary 's:25:\"en:Parse in preview mode.\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-prop',_binary 's:38:\"en:Which pieces of information to get:\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-pst',_binary 's:90:\"en:Do a pre-save transform on the input before parsing it. Only valid when used with text.\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-redirects',_binary 's:80:\"en:If <var>$1page</var> or <var>$1pageid</var> is set to a redirect, resolve it.\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-revid',_binary 's:87:\"en:Revision ID, for <code><nowiki>{{REVISIONID}}</nowiki></code> and similar variables.\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-section',_binary 's:243:\"en:Only parse the content of the section with this identifier.\n\nWhen <kbd>new</kbd>, parse <var>$1text</var> and <var>$1sectiontitle</var> as if adding a new section to the page.\n\n<kbd>new</kbd> is allowed only when specifying <var>text</var>.\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-sectionpreview',_binary 's:60:\"en:Parse in section preview mode (enables preview mode too).\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-sectiontitle',_binary 's:154:\"en:New section title when <var>section</var> is <kbd>new</kbd>.\n\nUnlike page editing, this does not fall back to <var>summary</var> when omitted or empty.\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-showstrategykeys',_binary 's:74:\"en:Whether to include internal merge strategy information in jsconfigvars.\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-summary',_binary 's:20:\"en:Summary to parse.\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-text',_binary 's:99:\"en:Text to parse. Use <var>$1title</var> or <var>$1contentmodel</var> to control the content model.\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-title',_binary 's:133:\"en:Title of page the text belongs to. If omitted, <var>$1contentmodel</var> must be specified, and [[API]] will be used as the title.\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-usearticle',_binary 's:103:\"en:Use the ArticleParserOptions hook to ensure the options used match those used for article page views\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-useskin',_binary 's:214:\"en:Apply the selected skin to the parser output. May affect the following properties: <kbd>text</kbd>, <kbd>langlinks</kbd>, <kbd>headitems</kbd>, <kbd>modules</kbd>, <kbd>jsconfigvars</kbd>, <kbd>indicators</kbd>.\";'),(_binary 'en',_binary 'messages:apihelp-parse-param-wrapoutputclass',_binary 's:46:\"en:CSS class to use to wrap the parser output.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-categories',_binary 's:47:\"en:Gives the categories in the parsed wikitext.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-categorieshtml',_binary 's:44:\"en:Gives the HTML version of the categories.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-displaytitle',_binary 's:41:\"en:Adds the title of the parsed wikitext.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-encodedjsconfigvars',_binary 's:86:\"en:Gives the JavaScript configuration variables specific to the page as a JSON string.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-externallinks',_binary 's:51:\"en:Gives the external links in the parsed wikitext.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-headhtml',_binary 's:144:\"en:Gives parsed doctype, opening <code>&lt;html&gt;</code>, <code>&lt;head&gt;</code> element and opening <code>&lt;body&gt;</code> of the page.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-headitems',_binary 's:67:\"en:Gives items to put in the <code>&lt;head&gt;</code> of the page.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-images',_binary 's:43:\"en:Gives the images in the parsed wikitext.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-indicators',_binary 's:61:\"en:Gives the HTML of page status indicators used on the page.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-iwlinks',_binary 's:48:\"en:Gives interwiki links in the parsed wikitext.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-jsconfigvars',_binary 's:113:\"en:Gives the JavaScript configuration variables specific to the page. To apply, use <code>mw.config.set()</code>.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-langlinks',_binary 's:51:\"en:Gives the language links in the parsed wikitext.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-limitreportdata',_binary 's:106:\"en:Gives the limit report in a structured way. Gives no data, when <var>$1disablelimitreport</var> is set.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-limitreporthtml',_binary 's:106:\"en:Gives the HTML version of the limit report. Gives no data, when <var>$1disablelimitreport</var> is set.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-links',_binary 's:51:\"en:Gives the internal links in the parsed wikitext.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-modules',_binary 's:214:\"en:Gives the ResourceLoader modules used on the page. To load, use <code>mw.loader.using()</code>. Either <kbd>jsconfigvars</kbd> or <kbd>encodedjsconfigvars</kbd> must be requested jointly with <kbd>modules</kbd>.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-parsetree',_binary 's:82:\"en:The XML parse tree of revision content (requires content model <code>$1</code>)\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-parsewarnings',_binary 's:72:\"en:Gives the warnings that occurred while parsing content (as wikitext).\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-parsewarningshtml',_binary 's:68:\"en:Gives the warnings that occurred while parsing content (as HTML).\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-properties',_binary 's:59:\"en:Gives various properties defined in the parsed wikitext.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-revid',_binary 's:43:\"en:Adds the revision ID of the parsed page.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-sections',_binary 's:45:\"en:Gives the sections in the parsed wikitext.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-subtitle',_binary 's:46:\"en:Adds the page subtitle for the parsed page.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-templates',_binary 's:46:\"en:Gives the templates in the parsed wikitext.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-text',_binary 's:41:\"en:Gives the parsed text of the wikitext.\";'),(_binary 'en',_binary 'messages:apihelp-parse-paramvalue-prop-wikitext',_binary 's:47:\"en:Gives the original wikitext that was parsed.\";'),(_binary 'en',_binary 'messages:apihelp-parse-summary',_binary 's:44:\"en:Parses content and returns parser output.\";'),(_binary 'en',_binary 'messages:apihelp-patrol-example-rcid',_binary 's:26:\"en:Patrol a recent change.\";'),(_binary 'en',_binary 'messages:apihelp-patrol-example-revid',_binary 's:21:\"en:Patrol a revision.\";'),(_binary 'en',_binary 'messages:apihelp-patrol-param-rcid',_binary 's:30:\"en:Recentchanges ID to patrol.\";'),(_binary 'en',_binary 'messages:apihelp-patrol-param-revid',_binary 's:25:\"en:Revision ID to patrol.\";'),(_binary 'en',_binary 'messages:apihelp-patrol-param-tags',_binary 's:55:\"en:Change tags to apply to the entry in the patrol log.\";'),(_binary 'en',_binary 'messages:apihelp-patrol-summary',_binary 's:29:\"en:Patrol a page or revision.\";'),(_binary 'en',_binary 'messages:apihelp-php-param-formatversion',_binary 's:20:\"en:Output formatting\";'),(_binary 'en',_binary 'messages:apihelp-php-paramvalue-formatversion-1',_binary 's:97:\"en:Backwards-compatible format (XML-style booleans, <samp>*</samp> keys for content nodes, etc.).\";'),(_binary 'en',_binary 'messages:apihelp-php-paramvalue-formatversion-2',_binary 's:17:\"en:Modern format.\";'),(_binary 'en',_binary 'messages:apihelp-php-paramvalue-formatversion-latest',_binary 's:78:\"en:Use the latest format (currently <kbd>2</kbd>), may change without warning.\";'),(_binary 'en',_binary 'messages:apihelp-php-summary',_binary 's:40:\"en:Output data in serialized PHP format.\";'),(_binary 'en',_binary 'messages:apihelp-phpfm-summary',_binary 's:63:\"en:Output data in serialized PHP format (pretty-print in HTML).\";'),(_binary 'en',_binary 'messages:apihelp-protect-example-protect',_binary 's:18:\"en:Protect a page.\";'),(_binary 'en',_binary 'messages:apihelp-protect-example-unprotect',_binary 's:108:\"en:Unprotect a page by setting restrictions to <kbd>all</kbd> (i.e. everyone is allowed to take the action).\";'),(_binary 'en',_binary 'messages:apihelp-protect-example-unprotect2',_binary 's:47:\"en:Unprotect a page by setting no restrictions.\";'),(_binary 'en',_binary 'messages:apihelp-protect-param-cascade',_binary 's:163:\"en:Enable cascading protection (i.e. protect transcluded templates and images used in this page). Ignored if none of the given protection levels support cascading.\";'),(_binary 'en',_binary 'messages:apihelp-protect-param-expiry',_binary 's:209:\"en:Expiry timestamps. If only one timestamp is set, it\'ll be used for all protections. Use <kbd>infinite</kbd>, <kbd>indefinite</kbd>, <kbd>infinity</kbd>, or <kbd>never</kbd>, for a never-expiring protection.\";'),(_binary 'en',_binary 'messages:apihelp-protect-param-pageid',_binary 's:71:\"en:ID of the page to (un)protect. Cannot be used together with $1title.\";'),(_binary 'en',_binary 'messages:apihelp-protect-param-protections',_binary 's:265:\"en:List of protection levels, formatted <kbd>action=level</kbd> (e.g. <kbd>edit=sysop</kbd>). A level of <kbd>all</kbd> means everyone is allowed to take the action, i.e. no restriction.\n\n<strong>Note:</strong> Any actions not listed will have restrictions removed.\";'),(_binary 'en',_binary 'messages:apihelp-protect-param-reason',_binary 's:29:\"en:Reason for (un)protecting.\";'),(_binary 'en',_binary 'messages:apihelp-protect-param-tags',_binary 's:59:\"en:Change tags to apply to the entry in the protection log.\";'),(_binary 'en',_binary 'messages:apihelp-protect-param-title',_binary 's:75:\"en:Title of the page to (un)protect. Cannot be used together with $1pageid.\";'),(_binary 'en',_binary 'messages:apihelp-protect-param-watch',_binary 's:76:\"en:If set, add the page being (un)protected to the current user\'s watchlist.\";'),(_binary 'en',_binary 'messages:apihelp-protect-param-watchlist',_binary 's:140:\"en:Unconditionally add or remove the page from the current user\'s watchlist, use preferences (ignored for bot users) or do not change watch.\";'),(_binary 'en',_binary 'messages:apihelp-protect-param-watchlistexpiry',_binary 's:98:\"en:Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.\";'),(_binary 'en',_binary 'messages:apihelp-protect-summary',_binary 's:41:\"en:Change the protection level of a page.\";'),(_binary 'en',_binary 'messages:apihelp-purge-example-generator',_binary 's:50:\"en:Purge the first 10 pages in the main namespace.\";'),(_binary 'en',_binary 'messages:apihelp-purge-example-simple',_binary 's:75:\"en:Purge <kbd>[[{{MediaWiki:Mainpage}}]]</kbd> and the <kbd>API</kbd> page.\";'),(_binary 'en',_binary 'messages:apihelp-purge-param-forcelinkupdate',_binary 's:63:\"en:Update the links tables and do other secondary data updates.\";'),(_binary 'en',_binary 'messages:apihelp-purge-param-forcerecursivelinkupdate',_bi