 's:71:\"en:Adds the page ID, recent changes ID and the new and old revision ID.\";'),(_binary 'en',_binary 'messages:apihelp-query+recentchanges-paramvalue-prop-loginfo',_binary 's:63:\"en:Adds log information (log ID, log type, etc) to log entries.\";'),(_binary 'en',_binary 'messages:apihelp-query+recentchanges-paramvalue-prop-parsedcomment',_binary 's:138:\"en:Adds the parsed comment for the edit. If the comment has been revision deleted, a <samp>commenthidden</samp> property will be returned.\";'),(_binary 'en',_binary 'messages:apihelp-query+recentchanges-paramvalue-prop-patrolled',_binary 's:60:\"en:Tags patrollable edits as being patrolled or unpatrolled.\";'),(_binary 'en',_binary 'messages:apihelp-query+recentchanges-paramvalue-prop-redirect',_binary 's:35:\"en:Tags edit if page is a redirect.\";'),(_binary 'en',_binary 'messages:apihelp-query+recentchanges-paramvalue-prop-sha1',_binary 's:163:\"en:Adds the content checksum for entries associated with a revision. If the content has been revision deleted, a <samp>sha1hidden</samp> property will be returned.\";'),(_binary 'en',_binary 'messages:apihelp-query+recentchanges-paramvalue-prop-sizes',_binary 's:45:\"en:Adds the new and old page length in bytes.\";'),(_binary 'en',_binary 'messages:apihelp-query+recentchanges-paramvalue-prop-tags',_binary 's:28:\"en:Lists tags for the entry.\";'),(_binary 'en',_binary 'messages:apihelp-query+recentchanges-paramvalue-prop-timestamp',_binary 's:30:\"en:Adds timestamp of the edit.\";'),(_binary 'en',_binary 'messages:apihelp-query+recentchanges-paramvalue-prop-title',_binary 's:35:\"en:Adds the page title of the edit.\";'),(_binary 'en',_binary 'messages:apihelp-query+recentchanges-paramvalue-prop-user',_binary 's:161:\"en:Adds the user responsible for the edit and tags if they are an IP. If the user has been revision deleted, a <samp>userhidden</samp> property will be returned.\";'),(_binary 'en',_binary 'messages:apihelp-query+recentchanges-paramvalue-prop-userid',_