'en',_binary 'messages:apihelp-upload-extended-description',_binary 's:550:\"en:Several methods are available:\n* Upload file contents directly, using the <var>$1file</var> parameter.\n* Upload the file in pieces, using the <var>$1filesize</var>, <var>$1chunk</var>, and <var>$1offset</var> parameters.\n* Have the MediaWiki server fetch a file from a URL, using the <var>$1url</var> parameter.\n* Complete an earlier upload that failed due to warnings, using the <var>$1filekey</var> parameter.\nNote that the HTTP POST must be done as a file upload (i.e. using <code>multipart/form-data</code>) when sending the <var>$1file</var>.\";'),(_binary 'en',_binary 'messages:apihelp-upload-param-async',_binary 's:69:\"en:Make potentially large file operations asynchronous when possible.\";'),(_binary 'en',_binary 'messages:apihelp-upload-param-checkstatus',_binary 's:55:\"en:Only fetch the upload status for the given file key.\";'),(_binary 'en',_binary 'messages:apihelp-upload-param-chunk',_binary 's:18:\"en:Chunk contents.\";'),(_binary 'en',_binary 'messages:apihelp-upload-param-comment',_binary 's:106:\"en:Upload comment. Also used as the initial page text for new files if <var>$1text</var> is not specified.\";'),(_binary 'en',_binary 'messages:apihelp-upload-param-file',_binary 's:17:\"en:File contents.\";'),(_binary 'en',_binary 'messages:apihelp-upload-param-filekey',_binary 's:70:\"en:Key that identifies a previous upload that was stashed temporarily.\";'),(_binary 'en',_binary 'messages:apihelp-upload-param-filename',_binary 's:19:\"en:Target filename.\";'),(_binary 'en',_binary 'messages:apihelp-upload-param-filesize',_binary 's:29:\"en:Filesize of entire upload.\";'),(_binary 'en',_binary 'messages:apihelp-upload-param-ignorewarnings',_binary 's:23:\"en:Ignore any warnings.\";'),(_binary 'en',_binary 'messages:apihelp-upload-param-offset',_binary 's:28:\"en:Offset of chunk in bytes.\";'),(_binary 'en',_binary 'messages:apihelp-upload-param-sessionkey',_binary 's:60:\"e