:\"en:Initializing statistics\";'),(_binary 'en',_binary 'messages:config-install-step-done',_binary 's:7:\"en:done\";'),(_binary 'en',_binary 'messages:config-install-step-failed',_binary 's:9:\"en:failed\";'),(_binary 'en',_binary 'messages:config-install-subscribe',_binary 's:36:\"en:Subscribing to mediawiki-announce\";'),(_binary 'en',_binary 'messages:config-install-subscribe-alreadypending',_binary 's:145:\"en:A request to subscribe to mediawiki-announce had already been submitted. Please reply to the confirmation email that had previously been sent.\";'),(_binary 'en',_binary 'messages:config-install-subscribe-alreadysubscribed',_binary 's:177:\"en:You are already subscribed to mediawiki-announce. [https://lists.wikimedia.org/postorius/accounts/per-subscription-preferences/ View or change your subscription preferences].\";'),(_binary 'en',_binary 'messages:config-install-subscribe-fail',_binary 's:134:\"en:Unable to subscribe to [https://lists.wikimedia.org/postorius/lists/mediawiki-announce.lists.wikimedia.org/ mediawiki-announce]: $1\";'),(_binary 'en',_binary 'messages:config-install-subscribe-notpossible',_binary 's:75:\"en:cURL is not installed and <code>allow_url_fopen</code> is not available.\";'),(_binary 'en',_binary 'messages:config-install-subscribe-possiblefail',_binary 's:293:\"en:Your request to subscribe to mediawiki-announce might not have gone through. If you don\'t receive a confirmation email within a few minutes, go to [https://lists.wikimedia.org/postorius/lists/mediawiki-announce.lists.wikimedia.org/ lists.wikimedia.org] to try submitting your request again.\";'),(_binary 'en',_binary 'messages:config-install-success',_binary 's:276:\"en:MediaWiki has been successfully installed. You can now visit <$1$2> to view your wiki.\nIf you have questions, check out our frequently asked questions list:\n<https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:FAQ> or use one of the\nsupport forums linked on that page.\";'),(_binary 'en',_binary 'messages:config-install-sysop',_binary 's:38:\"en:Creating administrator user account\";'),(_binary 'en',_binary 'messages:config-install-tables',_binary 's:18:\"en:Creating tables\";'),(_binary 'en',_binary 'messages:config-install-tables-exist',_binary 's:87:\"en:<strong>Warning:</strong> MediaWiki tables seem to already exist.\nSkipping creation.\";'),(_binary 'en',_binary 'messages:config-install-tables-failed',_binary 's:77:\"en:<strong>Error:</strong> Table creation failed with the following error: $1\";'),(_binary 'en',_binary 'messages:config-install-updates',_binary 's:35:\"en:Prevent running unneeded updates\";'),(_binary 'en',_binary 'messages:config-install-updates-failed',_binary 's:96:\"en:<strong>Error:</strong> Inserting update keys into tables failed with the following error: $1\";'),(_binary 'en',_binary 'messages:config-install-user',_binary 's:25:\"en:Creating database user\";'),(_binary 'en',_binary 'messages:config-install-user-alreadyexists',_binary 's:27:\"en:User \"$1\" already exists\";'),(_binary 'en',_binary 'messages:config-install-user-create-failed',_binary 's:32:\"en:Creating user \"$1\" failed: $2\";'),(_binary 'en',_binary 'messages:config-install-user-grant-failed',_binary 's:46:\"en:Granting permission to user \"$1\" failed: $2\";'),(_binary 'en',_binary 'messages:config-install-user-missing',_binary 's:42:\"en:The specified user \"$1\" does not exist.\";'),(_binary 'en',_binary 'messages:config-install-user-missing-create',_binary 's:117:\"en:The specified user \"$1\" does not exist.\nPlease click the \"create account\" checkbox below if you want to create it.\";'),(_binary 'en',_binary 'messages:config-instantcommons',_binary 's:25:\"en:Enable Instant Commons\";'),(_binary 'en',_binary 'messages:config-instantcommons-help',_binary 's:513:\"en:[https://www.mediawiki.org/wiki/Special:MyLanguage/InstantCommons Instant Commons] is a feature that allows wikis to use images, sounds and other media found on the [https://commons.wikimedia.org/ Wikimedia Commons] site.\nIn order to do this, MediaWiki requires access to the Internet.\n\nFor more information on this feature, including instructions on how to set it up for wikis other than the Wikimedia Commons, consult [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:$wgForeignFileRepos the manual].\";'),(_binary 'en',_binary 'messages:config-invalid-db-name',_binary 's:113:\"en:Invalid database name \"$1\".\nUse only ASCII letters (a-z, A-Z), numbers (0-9), underscores (_) and hyphens (-).\";'),(_binary 'en',_binary 'messages:config-invalid-db-prefix',_binary 's:115:\"en:Invalid database prefix \"$1\".\nUse only ASCII letters (a-z, A-Z), numbers (0-9), underscores (_) and hyphens (-).\";'),(_binary 'en',_binary 'messages:config-invalid-db-type',_binary 's:25:\"en:Invalid database type.\";'),(_binary 'en',_binary 'messages:config-invalid-key',_binary 's:53:\"en:Invalid MediaWiki configuration parameter \"$1\": $2\";'),(_binary 'en',_binary 'messages:config-invalid-schema',_binary 's:107:\"en:Invalid schema for MediaWiki \"$1\".\nUse only ASCII letters (a-z, A-Z), numbers (0-9) and underscores (_).\";'),(_binary 'en',_binary 'messages:config-license',_binary 's:25:\"en:Copyright and license:\";'),(_binary 'en',_binary 'messages:config-license-cc-0',_binary 's:40:\"en:Creative Commons Zero (Public Domain)\";'),(_binary 'en',_binary 'messages:config-license-cc-by',_binary 's:31:\"en:Creative Commons Attribution\";'),(_binary 'en',_binary 'messages:config-license-cc-by-nc-sa',_binary 's:56:\"en:Creative Commons Attribution-NonCommercial-ShareAlike\";'),(_binary 'en',_binary 'messages:config-license-cc-by-sa',_binary 's:42:\"en:Creative Commons Attribution-ShareAlike\";'),(_binary 'en',_binary 'messages:config-license-gfdl',_binary 's:46:\"en:GNU Free Documentation License 1.3 or later\";'),(_binary 'en',_binary 'messages:config-license-help',_binary 's:640:\"en:Many public wikis put all contributions under a [https://freedomdefined.org/Definition free license].\nThis helps to create a sense of community ownership and encourages long-term contribution.\nIt is not generally necessary for a private or corporate wiki.\n\nIf you want to be able to use text from Wikipedia, and you want Wikipedia to be able to accept text copied from your wiki, you should choose <strong>{{int:config-license-cc-by-sa}}</strong>.\n\nWikipedia previously used the GNU Free Documentation License.\nThe GFDL is a valid license, but it is difficult to understand.\nIt is also difficult to reuse content licensed under the GFDL.\";'),(_binary 'en',_binary 'messages:config-license-none',_binary 's:20:\"en:No license footer\";'),(_binary 'en',_binary 'messages:config-license-pd',_binary 's:16:\"en:Public Domain\";'),(_binary 'en',_binary 'messages:config-localsettings-badkey',_binary 's:45:\"en:The upgrade key you provided is incorrect.\";'),(_binary 'en',_binary 'messages:config-localsettings-cli-upgrade',_binary 's:132:\"en:A <code>LocalSettings.php</code> file has been detected.\nTo upgrade this installation, please run <code>update.php</code> instead\";'),(_binary 'en',_binary 'messages:config-localsettings-connection-error',_binary 's:168:\"en:An error was encountered when connecting to the database using the settings specified in <code>LocalSettings.php</code>. Please fix these settings and try again.\n\n$1\";'),(_binary 'en',_binary 'messages:config-localsettings-incomplete',_binary 's:212:\"en:The existing <code>LocalSettings.php</code> appears to be incomplete.\nThe $1 variable is not set.\nPlease change <code>LocalSettings.php</code> so that this variable is set, and click \"{{int:Config-continue}}\".\";'),(_binary 'en',_binary 'messages:config-localsettings-key',_binary 's:15:\"en:Upgrade key:\";'),(_binary 'en',_binary 'messages:config-localsettings-upgrade',_binary 's:212:\"en:A <code>LocalSettings.php</code> file has been detected.\nTo upgrade this installation, please enter the value of <code>$wgUpgradeKey</code> in the box below.\nYou will find it in <code>LocalSettings.php</code>.\";'),(_binary 'en',_binary 'messages:config-logo-filedrop',_binary 's:26:\"en:Drop an image file here\";'),(_binary 'en',_binary 'messages:config-logo-icon',_binary 's:15:\"en:Logo (icon):\";'),(_binary 'en',_binary 'messages:config-logo-icon-help',_binary 's:72:\"en:Your logo icon should be square and ideally more than 50px or an SVG.\";'),(_binary 'en',_binary 'messages:config-logo-preview-main',_binary 's:12:\"en:Main page\";'),(_binary 'en',_binary 'messages:config-logo-sidebar',_binary 's:27:\"en:Sidebar logo (optional):\";'),(_binary 'en',_binary 'messages:config-logo-sidebar-help',_binary 's:221:\"en:Some MediaWiki skins include a logo with 160 pixel height as part of the sidebar menu. If undefined, this is the same as the icon defined above. You may want to have a dedicated graphic that combines wordmark and icon.\";'),(_binary 'en',_binary 'messages:config-logo-summary',_binary 's:273:\"en:For each of these fields, you will need to upload an image of the appropriate size, and enter the URL in the boxes below. You can use <code>$wgStylePath</code> or <code>$wgScriptPath</code> if your logo is relative to those paths. You can leave any of these boxes blank.\";'),(_binary 'en',_binary 'messages:config-logo-tagline',_binary 's:22:\"en:Tagline (optional):\";'),(_binary 'en',_binary 'messages:config-logo-tagline-help',_binary 's:220:\"en:The tagline of your site. Use only if you have defined a wordmark above. If not defined, this will generally fall back to text. The combined height of the tagline and wordmark as a general rule should not exceed 50px.\";'),(_binary 'en',_binary 'messages:config-logo-wordmark',_binary 's:23:\"en:Wordmark (optional):\";'),(_binary 'en',_binary 'messages:config-logo-wordmark-help',_binary 's:135:\"en:The name of your site. If not defined, this will generally fall back to text. Ideally an SVG with height less than or equal to 30px.\";'),(_binary 'en',_binary 'messages:config-mariadb-old',_binary 's:48:\"en:MariaDB $1 or later is required. You have $2.\";'),(_binary 'en',_binary 'messages:config-memcache-badip',_binary 's:60:\"en:You have entered an invalid IP address for Memcached: $1.\";'),(_binary 'en',_binary 'messages:config-memcache-badport',_binary 's:54:\"en:Memcached port numbers should be between $1 and $2.\";'),(_binary 'en',_binary 'messages:config-memcache-needservers',_binary 's:77:\"en:You selected Memcached as your cache type but did not specify any servers.\";'),(_binary 'en',_binary 'messages:config-memcache-noport',_binary 's:113:\"en:You did not specify a port to use for Memcached server: $1.\nIf you do not know the port, the default is 11211.\";'),(_binary 'en',_binary 'messages:config-memcached-help',_binary 's:155:\"en:List of IP addresses to use for Memcached.\nShould specify one per line and specify the port to be used. For example:\n 127.0.0.1:11211\n 192.168.1.25:1234\";'),(_binary 'en',_binary 'messages:config-memcached-servers',_binary 's:21:\"en:Memcached servers:\";'),(_binary 'en',_binary 'messages:config-memory-bad',_binary 's:120:\"en:<strong>Warning:</strong> PHP\'s <code>memory_limit</code> is $1.\nThis is probably too low.\nThe installation may fail!\";'),(_binary 'en',_binary 'messages:config-memory-raised',_binary 's:55:\"en:PHP\'s <code>memory_limit</code> is $1, raised to $2.\";'),(_binary 'en',_binary 'messages:config-missing-db-host',_binary 's:55:\"en:You must enter a value for \"{{int:config-db-host}}\".\";'),(_binary 'en',_binary 'messages:config-missing-db-name',_binary 's:55:\"en:You must enter a value for \"{{int:config-db-name}}\".\";'),(_binary 'en',_binary 'messages:config-missing-key',_binary 's:49:\"en:Missing MediaWiki configuration parameter \"$1\"\";'),(_binary 'en',_binary 'messages:config-mod-security',_binary 's:433:\"en:<strong>Warning:</strong> Your web server has [https://modsecurity.org/ mod_security]/mod_security2 enabled. Many common configurations of this will cause problems for MediaWiki and other software that allows users to post arbitrary content.\nIf possible, this should be disabled. Otherwise, refer to [https://modsecurity.org/documentation/ mod_security documentation] or contact your host\'s support if you encounter random errors.\";'),(_binary 'en',_binary 'messages:config-mysql-engine',_binary 's:18:\"en:Storage engine:\";'),(_binary 'en',_binary 'messages:config-mysql-engine-help',_binary 's:254:\"en:<strong>InnoDB</strong> is almost always the best option, since it has good concurrency support.\n\n<strong>MyISAM</strong> may be faster in single-user or read-only installations.\nMyISAM databases tend to get corrupted more often than InnoDB databases.\";'),(_binary 'en',_binary 'messages:config-mysql-innodb',_binary 's:23:\"en:InnoDB (recommended)\";'),(_binary 'en',_binary 'messages:config-mysql-old',_binary 's:46:\"en:MySQL $1 or later is required. You have $2.\";'),(_binary 'en',_binary 'messages:config-no-cache-apcu',_binary 's:107:\"en:<strong>Warning:</strong> Could not find [https://www.php.net/apcu APCu].\nObject caching is not enabled.\";'),(_binary 'en',_binary 'messages:config-no-cli-uploads-check',_binary 's:168:\"en:<strong>Warning:</strong> Your default directory for uploads (<code>$1</code>) is not checked for vulnerability\nto arbitrary script execution during the CLI install.\";'),(_binary 'en',_binary 'messages:config-no-cli-uri',_binary 's:100:\"en:<strong>Warning:</strong> No <code>--scriptpath</code> specified, using default: <code>$1</code>.\";'),(_binary 'en',_binary 'messages:config-no-db',_binary 's:433:\"en:Could not find a suitable database driver! You need to install a database driver for PHP.\nThe following database {{PLURAL:$2|type is|types are}} supported: $1.\n\nIf you compiled PHP yourself, reconfigure it with a database client enabled, for example, using <code>./configure --with-mysqli</code>.\nIf you installed PHP from a Debian or Ubuntu package, then you also need to install, for example, the <code>php-mysql</code> package.\";'),(_binary 'en',_binary 'messages:config-no-fts3',_binary 's:150:\"en:<strong>Warning:</strong> SQLite is compiled without the [//sqlite.org/fts3.html FTS3 module], search features will be unavailable on this backend.\";'),(_binary 'en',_binary 'messages:config-no-scaling',_binary 's:81:\"en:Could not find GD library or ImageMagick.\nImage thumbnailing will be disabled.\";'),(_binary 'en',_binary 'messages:config-no-session',_binary 's:130:\"en:Your session data was lost!\nCheck your php.ini and make sure <code>session.save_path</code> is set to an appropriate directory.\";'),(_binary 'en',_binary 'messages:config-no-uri',_binary 's:85:\"en:<strong>Error:</strong> Could not determine the current URI.\nInstallation aborted.\";'),(_binary 'en',_binary 'messages:config-nofile',_binary 's:53:\"en:File \"$1\" could not be found. Has it been deleted?\";'),(_binary 'en',_binary 'messages:config-ns-conflict',_binary 's:133:\"en:The specified namespace \"<nowiki>$1</nowiki>\" conflicts with a default MediaWiki namespace.\nSpecify a different project namespace.\";'),(_binary 'en',_binary 'messages:config-ns-generic',_binary 's:10:\"en:Project\";'),(_binary 'en',_binary 'messages:config-ns-invalid',_binary 's:99:\"en:The specified namespace \"<nowiki>$1</nowiki>\" is invalid.\nSpecify a different project namespace.\";'),(_binary 'en',_binary 'messages:config-ns-other',_binary 's:18:\"en:Other (specify)\";'),(_binary 'en',_binary 'messages:config-ns-other-default',_binary 's:9:\"en:MyWiki\";'),(_binary 'en',_binary 'messages:config-ns-site-name',_binary 's:28:\"en:Same as the wiki name: $1\";'),(_binary 'en',_binary 'messages:config-optional-continue',_binary 's:25:\"en:Ask me more questions.\";'),(_binary 'en',_binary 'messages:config-optional-skip',_binary 's:44:\"en:I\'m bored already, just install the wiki.\";'),(_binary 'en',_binary 'messages:config-outdated-sqlite',_binary 's:125:\"en:<strong>Warning:</strong> you have SQLite $2, which is lower than minimum required version $1. SQLite will be unavailable.\";'),(_binary 'en',_binary 'messages:config-page-complete',_binary 's:12:\"en:Complete!\";'),(_binary 'en',_binary 'messages:config-page-copying',_binary 's:10:\"en:Copying\";'),(_binary 'en',_binary 'messages:config-page-dbconnect',_binary 's:22:\"en:Connect to database\";'),(_binary 'en',_binary 'messages:config-page-dbsettings',_binary 's:20:\"en:Database settings\";'),(_binary 'en',_binary 'messages:config-page-existingwiki',_binary 's:16:\"en:Existing wiki\";'),(_binary 'en',_binary 'messages:config-page-install',_binary 's:10:\"en:Install\";'),(_binary 'en',_binary 'messages:config-page-language',_binary 's:11:\"en:Language\";'),(_binary 'en',_binary 'messages:config-page-name',_binary 's:7:\"en:Name\";'),(_binary 'en',_binary 'messages:config-page-options',_binary 's:10:\"en:Options\";'),(_binary 'en',_binary 'messages:config-page-releasenotes',_binary 's:16:\"en:Release notes\";'),(_binary 'en',_binary 'messages:config-page-restart',_binary 's:23:\"en:Restart installation\";'),(_binary 'en',_binary 'messages:config-page-upgrade',_binary 's:32:\"en:Upgrade existing installation\";'),(_binary 'en',_binary 'messages:config-page-upgradedoc',_binary 's:12:\"en:Upgrading\";'),(_binary 'en',_binary 'messages:config-page-welcome',_binary 's:24:\"en:Welcome to MediaWiki!\";'),(_binary 'en',_binary 'messages:config-pcre-invalid-newline',_binary 's:161:\"en:<strong>Fatal:</strong> The PCRE2 library seems to be compiled with <code>--enable-newline-is-any</code>.\nMediaWiki is not compatible with this configuration.\";'),(_binary 'en',_binary 'messages:config-personalization-settings',_binary 's:18:\"en:Personalization\";'),(_binary 'en',_binary 'messages:config-pg-no-create-privs',_binary 's:99:\"en:The account you specified for installation does not have enough privileges to create an account.\";'),(_binary 'en',_binary 'messages:config-pg-no-plpgsql',_binary 's:63:\"en:You need to install the language PL/pgSQL in the database $1\";'),(_binary 'en',_binary 'messages:config-pg-not-in-role',_binary 's:401:\"en:The account you specified for the web user already exists.\nThe account you specified for installation is not a superuser and is not a member of the web user\'s role, so it is unable to create objects owned by the web user.\n\nMediaWiki currently requires that the tables be owned by the web user. Please specify another web account name, or click \"back\" and specify a suitably privileged install user.\";'),(_binary 'en',_binary 'messages:config-pg-test-error',_binary 's:53:\"en:Cannot connect to database <strong>$1</strong>: $2\";'),(_binary 'en',_binary 'messages:config-pingback',_binary 's:157:\"en:Share data about this installation with MediaWiki developers. [https://foundation.wikimedia.org/wiki/MediaWiki_Pingback_Privacy_Statement Privacy policy].\";'),(_binary 'en',_binary 'messages:config-pingback-help',_binary 's:721:\"en:If you select this option, MediaWiki will periodically ping https://www.mediawiki.org with basic data about this MediaWiki instance. This data includes, for example, the type of system, PHP version, and chosen database backend. The Wikimedia Foundation shares this data with MediaWiki developers to help guide future development efforts. The following data will be sent for your system:\n<pre>$1</pre>\n\nThe privacy policy for this feature can be seen at https://foundation.wikimedia.org/wiki/MediaWiki_Pingback_Privacy_Statement.\n\nFor more general information about this feature, see https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:$wgPingback.\n\nFor aggregated pingback data, see https://pingback.wmcloud.org/.\";'),(_binary 'en',_binary 'messages:config-postgres-old',_binary 's:51:\"en:PostgreSQL $1 or later is required. You have $2.\";'),(_binary 'en',_binary 'messages:config-profile',_binary 's:23:\"en:User rights profile:\";'),(_binary 'en',_binary 'messages:config-profile-fishbowl',_binary 's:26:\"en:Authorized editors only\";'),(_binary 'en',_binary 'messages:config-profile-help',_binary 's:1059:\"en:Wikis work best when you let as many people edit them as possible.\nIn MediaWiki, it is easy to review the recent changes, and to revert any damage that is done by naive or malicious users.\n\nHowever, many have found MediaWiki to be useful in a wide variety of roles, and sometimes it is not easy to convince everyone of the benefits of the wiki way.\nSo you have the choice.\n\nThe <strong>{{int:config-profile-wiki}}</strong> model allows anyone to edit, without even logging in.\nA wiki with <strong>{{int:config-profile-no-anon}}</strong> provides extra accountability, but may deter casual contributors.\n\nThe <strong>{{int:config-profile-fishbowl}}</strong> scenario allows approved users to edit, but the public can view the pages, including history.\nA <strong>{{int:config-profile-private}}</strong> only allows approved users to view pages, with the same group allowed to edit.\n\nMore complex user rights configurations are available after installation, see the [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:User_rights relevant manual entry].\";'),(_binary 'en',_binary 'messages:config-profile-no-anon',_binary 's:28:\"en:Account creation required\";'),(_binary 'en',_binary 'messages:config-profile-private',_binary 's:15:\"en:Private wiki\";'),(_binary 'en',_binary 'messages:config-profile-wiki',_binary 's:12:\"en:Open wiki\";'),(_binary 'en',_binary 'messages:config-project-namespace',_binary 's:21:\"en:Project namespace:\";'),(_binary 'en',_binary 'messages:config-project-namespace-help',_binary 's:348:\"en:Following Wikipedia\'s example, many wikis keep their policy pages separate from their content pages, in a \'\'\'project namespace\'\'\'.\nAll page titles in this namespace start with a certain prefix, which you can specify here.\nUsually, this prefix is derived from the name of the wiki, but it cannot contain punctuation characters such as \"#\" or \":\".\";'),(_binary 'en',_binary 'messages:config-regenerate',_binary 's:35:\"en:Regenerate LocalSettings.php →\";'),(_binary 'en',_binary 'messages:config-restart',_binary 's:18:\"en:Yes, restart it\";'),(_binary 'en',_binary 'messages:config-screenshot',_binary 's:13:\"en:screenshot\";'),(_binary 'en',_binary 'messages:config-server',_binary 's:17:\"en:URL host name:\";'),(_binary 'en',_binary 'messages:config-server-help',_binary 's:126:\"en:The protocol and host name part of the URL used to access your wiki. The automatically detected default is usually correct.\";'),(_binary 'en',_binary 'messages:config-session-error',_binary 's:29:\"en:Error starting session: $1\";'),(_binary 'en',_binary 'messages:config-session-expired',_binary 's:204:\"en:Your session data seems to have expired.\nSessions are configured for a lifetime of $1.\nYou can increase this by setting <code>session.gc_maxlifetime</code> in php.ini.\nRestart the installation process.\";'),(_binary 'en',_binary 'messages:config-show-table-status',_binary 's:47:\"en:<code>SHOW TABLE STATUS</code> query failed!\";'),(_binary 'en',_binary 'messages:config-sidebar',_binary 's:501:\"en:* [https://www.mediawiki.org MediaWiki home]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Help:Contents User\'s Guide]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Contents Administrator\'s Guide]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:FAQ FAQ]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Communication Seek help]\n* [https://phabricator.wikimedia.org/ Bug tracker]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/How_to_contribute Contribute]\";'),(_binary 'en',_binary 'messages:config-sidebar-license',_binary 's:10:\"en:Copying\";'),(_binary 'en',_binary 'messages:config-sidebar-relnotes',_binary 's:16:\"en:Release notes\";'),(_binary 'en',_binary 'messages:config-sidebar-upgrade',_binary 's:12:\"en:Upgrading\";'),(_binary 'en',_binary 'messages:config-site-name',_binary 's:16:\"en:Name of wiki:\";'),(_binary 'en',_binary 'messages:config-site-name-blank',_binary 's:21:\"en:Enter a site name.\";'),(_binary 'en',_binary 'messages:config-site-name-help',_binary 's:80:\"en:This will appear in the title bar of the browser and in various other places.\";'),(_binary 'en',_binary 'messages:config-skins',_binary 's:8:\"en:Skins\";'),(_binary 'en',_binary 'messages:config-skins-help',_binary 's:133:\"en:The skins listed above were detected in your <code>./skins</code> directory. You must enable at least one, and choose the default.\";'),(_binary 'en',_binary 'messages:config-skins-missing',_binary 's:94:\"en:No skins were found; MediaWiki will use a fallback skin until you install some proper ones.\";'),(_binary 'en',_binary 'messages:config-skins-must-enable-default',_binary 's:46:\"en:The skin chosen as default must be enabled.\";'),(_binary 'en',_binary 'messages:config-skins-must-enable-some',_binary 's:47:\"en:You must choose at least one skin to enable.\";'),(_binary 'en',_binary 'messages:config-skins-screenshot',_binary 's:10:\"en:$1 ($2)\";'),(_binary 'en',_binary 'messages:config-skins-screenshots',_binary 's:23:\"en:$1 (screenshots: $2)\";'),(_binary 'en',_binary 'messages:config-skins-use-as-default',_binary 's:27:\"en:Use this skin as default\";'),(_binary 'en',_binary 'messages:config-skip-shared-domain',_binary 's:42:\"en:Skipping potentially shared domain \"$1\"\";'),(_binary 'en',_binary 'messages:config-sqlite-cant-create-db',_binary 's:50:\"en:Could not create database file <code>$1</code>.\";'),(_binary 'en',_binary 'messages:config-sqlite-connection-error',_binary 's:71:\"en:$1.\n\nCheck the data directory and database name below and try again.\";'),(_binary 'en',_binary 'messages:config-sqlite-dir',_binary 's:25:\"en:SQLite data directory:\";'),(_binary 'en',_binary 'messages:config-sqlite-dir-help',_binary 's:625:\"en:SQLite stores all data in a single file.\n\nThe directory you provide must be writable by the webserver during installation.\n\nIt should <strong>not</strong> be accessible via the web; this is why we\'re not putting it where your PHP files are.\n\nThe installer will write a <code>.htaccess</code> file along with it, but if that fails someone can gain access to your raw database.\nThat includes raw user data (email addresses, hashed passwords) as well as deleted revisions and other restricted data on the wiki.\n\nConsider putting the database somewhere else altogether, for example in <code>/var/lib/mediawiki/yourwiki</code>.\";'),(_binary 'en',_binary 'messages:config-sqlite-dir-unwritable',_binary 's:118:\"en:Unable to write to the directory \"$1\".\nChange its permissions so that the webserver can write to it, and try again.\";'),(_binary 'en',_binary 'messages:config-sqlite-fts3-downgrade',_binary 's:51:\"en:PHP is missing FTS3 support, downgrading tables.\";'),(_binary 'en',_binary 'messages:config-sqlite-mkdir-error',_binary 's:76:\"en:Error creating the data directory \"$1\".\nCheck the location and try again.\";'),(_binary 'en',_binary 'messages:config-sqlite-name-help',_binary 's:121:\"en:Choose a name that identifies your wiki.\nDo not use spaces or hyphens.\nThis will be used for the SQLite data filename.\";'),(_binary 'en',_binary 'messages:config-sqlite-parent-unwritable-group',_binary 's:393:\"en:Cannot create the data directory <code><nowiki>$1</nowiki></code>, because the parent directory <code><nowiki>$2</nowiki></code> is not writable by the webserver.\n\nThe installer has determined the user your webserver is running as.\nMake the <code><nowiki>$3</nowiki></code> directory writable by it to continue.\nOn a Unix/Linux system do:\n\n<pre>cd $2\nmkdir $3\nchgrp $4 $3\nchmod g+w $3</pre>\";'),(_binary 'en',_binary 'messages:config-sqlite-parent-unwritable-nogroup',_binary 's:409:\"en:Cannot create the data directory <code><nowiki>$1</nowiki></code>, because the parent directory <code><nowiki>$2</nowiki></code> is not writable by the webserver.\n\nThe installer could not determine the user your webserver is running as.\nMake the <code><nowiki>$3</nowiki></code> directory globally writable by it (and others!) to continue.\nOn a Unix/Linux system do:\n\n<pre>cd $2\nmkdir $3\nchmod a+w $3</pre>\";'),(_binary 'en',_binary 'messages:config-sqlite-readonly',_binary 's:45:\"en:The file <code>$1</code> is not writeable.\";'),(_binary 'en',_binary 'messages:config-subscribe',_binary 's:141:\"en:Subscribe to the [https://lists.wikimedia.org/postorius/lists/mediawiki-announce.lists.wikimedia.org/ release announcements mailing list].\";'),(_binary 'en',_binary 'messages:config-subscribe-help',_binary 's:206:\"en:This is a low-volume mailing list used for release announcements, including important security announcements.\nYou should subscribe to it and update your MediaWiki installation when new versions come out.\";'),(_binary 'en',_binary 'messages:config-subscribe-noemail',_binary 's:181:\"en:You tried to subscribe to the release announcements mailing list without providing an email address.\nPlease provide an email address if you wish to subscribe to the mailing list.\";'),(_binary 'en',_binary 'messages:config-support-info',_binary 's:193:\"en:MediaWiki supports the following database systems:\n\n$1\n\nIf you do not see the database system you are trying to use listed below, then follow the instructions linked above to enable support.\";'),(_binary 'en',_binary 'messages:config-title',_binary 's:28:\"en:MediaWiki $1 installation\";'),(_binary 'en',_binary 'messages:config-type-mysql',_binary 's:32:\"en:MariaDB, MySQL, or compatible\";'),(_binary 'en',_binary 'messages:config-type-postgres',_binary 's:13:\"en:PostgreSQL\";'),(_binary 'en',_binary 'messages:config-type-sqlite',_binary 's:9:\"en:SQLite\";'),(_binary 'en',_binary 'messages:config-unknown-collation',_binary 's:70:\"en:<strong>Warning:</strong> Database is using unrecognized collation.\";'),(_binary 'en',_binary 'messages:config-upgrade-done',_binary 's:242:\"en:Upgrade complete.\n\nYou can now [$1 start using your wiki].\n\nIf you want to regenerate your <code>LocalSettings.php</code> file, click the button below.\nThis is <strong>not recommended</strong> unless you are having problems with your wiki.\";'),(_binary 'en',_binary 'messages:config-upgrade-done-no-regenerate',_binary 's:61:\"en:Upgrade complete.\n\nYou can now [$1 start using your wiki].\";'),(_binary 'en',_binary 'messages:config-upgrade-error',_binary 's:165:\"en:There was an error while upgrading the MediaWiki tables in your database.\n\nFor more information look into the log above, to retry click <strong>Continue</strong>.\";'),(_binary 'en',_binary 'messages:config-upgrade-key-missing',_binary 's:177:\"en:An existing installation of MediaWiki has been detected.\nTo upgrade this installation, please put the following line at the bottom of your <code>LocalSettings.php</code>:\n\n$1\";'),(_binary 'en',_binary 'messages:config-upload-deleted',_binary 's:31:\"en:Directory for deleted files:\";'),(_binary 'en',_binary 'messages:config-upload-deleted-help',_binary 's:109:\"en:Choose a directory in which to archive deleted files.\nIdeally, this should not be accessible from the web.\";'),(_binary 'en',_binary 'messages:config-upload-enable',_binary 's:22:\"en:Enable file uploads\";'),(_binary 'en',_binary 'messages:config-upload-help',_binary 's:375:\"en:File uploads potentially expose your server to security risks.\nFor more information, read the [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Security security section] in the manual.\n\nTo enable file uploads, change the mode on the <code>images</code> subdirectory under MediaWiki\'s root directory so that the web server can write to it.\nThen enable this option.\";'),(_binary 'en',_binary 'messages:config-upload-settings',_binary 's:26:\"en:Images and file uploads\";'),(_binary 'en',_binary 'messages:config-uploads-not-safe',_binary 's:363:\"en:<strong>Warning:</strong> Your default directory for uploads <code>$1</code> is vulnerable to arbitrary scripts execution.\nAlthough MediaWiki checks all uploaded files for security threats, it is highly recommended to [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Security#Upload_security close this security vulnerability] before enabling uploads.\";'),(_binary 'en',_binary 'messages:config-uploads-security-headers',_binary 's:370:\"en:<strong>Warning:</strong> Requests for images in your uploads directory should answer with the HTTP header <code>$1</code> to protect browsers from potentially unsafe files.\nIt is highly recommended to [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Security#Upload_security configure appropriate response headers on your webserver] before enabling uploads.\";'),(_binary 'en',_binary 'messages:config-uploads-security-requesterror',_binary 's:418:\"en:<strong>Warning:</strong> Because of a connection error, it was not possibly to verify that images in your uploads directory, respond with the HTTP header <code>$1</code> to protect browsers from potentially unsafe files.\nIt is highly recommended to [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Security#Upload_security configure appropriate response headers on your webserver] before enabling uploads.\";'),(_binary 'en',_binary 'messages:config-using-32bit',_binary 's:171:\"en:<strong>Warning:</strong> your system appears to be running with 32-bit integers. This is [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:32-bit not advised].\";'),(_binary 'en',_binary 'messages:config-using-server',_binary 's:43:\"en:Using server name \"<nowiki>$1</nowiki>\".\";'),(_binary 'en',_binary 'messages:config-using-uri',_binary 's:44:\"en:Using server URL \"<nowiki>$1$2</nowiki>\".\";'),(_binary 'en',_binary 'messages:config-welcome',_binary 's:596:\"en:MediaWiki is a free and open-source wiki software package written in PHP. It serves as the platform for Wikipedia and the other Wikimedia projects, used by hundreds of millions of people each month. MediaWiki is localised in over 350 languages and its reliability and robust feature set have earned it a large and vibrant community of third-party users and developers.\n=== Environmental checks ===\nBasic checks will now be performed to see if this environment is suitable for MediaWiki installation.\nRemember to include this information if you seek support on how to complete the installation.\";'),(_binary 'en',_binary 'messages:config-welcome-section-copyright',_binary 's:830:\"en:=== Copyright and Terms ===\n\n$1\n\nThis program is free software; you can redistribute it and/or modify it under the terms of the GNU General Public License as published by the Free Software Foundation; either version 2 of the License, or (at your option) any later version.\n\nThis program is distributed in the hope that it will be useful, but <strong>without any warranty</strong>; without even the implied warranty of <strong>merchantability</strong> or <strong>fitness for a particular purpose</strong>.\nSee the GNU General Public License for more details.\n\nYou should have received [$2 a copy of the GNU General Public License] along with this program; if not, write to the Free Software Foundation, Inc., 51 Franklin Street, Fifth Floor, Boston, MA 02110-1301, USA, or [https://www.gnu.org/copyleft/gpl.html read it online].\";'),(_binary 'en',_binary 'messages:config-wiki-language',_binary 's:17:\"en:Wiki language:\";'),(_binary 'en',_binary 'messages:config-wiki-language-help',_binary 's:70:\"en:Select the language that the wiki will predominantly be written in.\";'),(_binary 'en',_binary 'messages:config-your-language',_binary 's:17:\"en:Your language:\";'),(_binary 'en',_binary 'messages:config-your-language-help',_binary 's:60:\"en:Select a language to use during the installation process.\";'),(_binary 'en',_binary 'messages:confirm',_binary 's:10:\"en:Confirm\";'),(_binary 'en',_binary 'messages:confirm-markpatrolled-button',_binary 's:5:\"en:OK\";'),(_binary 'en',_binary 'messages:confirm-markpatrolled-top',_binary 's:39:\"en:Mark revision $3 of $2 as patrolled?\";'),(_binary 'en',_binary 'messages:confirm-mcrrestore-title',_binary 's:21:\"en:Restore a revision\";'),(_binary 'en',_binary 'messages:confirm-mcrundo-title',_binary 's:16:\"en:Undo a change\";'),(_binary 'en',_binary 'messages:confirm-purge-bottom',_binary 's:82:\"en:Purging a page clears the cache and forces the most current revision to appear.\";'),(_binary 'en',_binary 'messages:confirm-purge-title',_binary 's:18:\"en:Purge this page\";'),(_binary 'en',_binary 'messages:confirm-purge-top',_binary 's:32:\"en:Purge the cache of this page?\";'),(_binary 'en',_binary 'messages:confirm-rollback-bottom',_binary 's:73:\"en:This action will instantly rollback the selected changes to this page.\";'),(_binary 'en',_binary 'messages:confirm-rollback-button',_binary 's:5:\"en:OK\";'),(_binary 'en',_binary 'messages:confirm-rollback-top',_binary 's:29:\"en:Revert edits to this page?\";'),(_binary 'en',_binary 'messages:confirm-unwatch-button',_binary 's:5:\"en:OK\";'),(_binary 'en',_binary 'messages:confirm-unwatch-top',_binary 's:40:\"en:Remove this page from your watchlist?\";'),(_binary 'en',_binary 'messages:confirm-watch-button',_binary 's:5:\"en:OK\";'),(_binary 'en',_binary 'messages:confirm-watch-button-expiry',_binary 's:8:\"en:Watch\";'),(_binary 'en',_binary 'messages:confirm-watch-label',_binary 's:25:\"en:Watchlist time period:\";'),(_binary 'en',_binary 'messages:confirm-watch-top',_binary 's:35:\"en:Add this page to your watchlist?\";'),(_binary 'en',_binary 'messages:confirm_purge_button',_binary 's:5:\"en:OK\";'),(_binary 'en',_binary 'messages:confirmable-confirm',_binary 's:30:\"en:Are {{GENDER:$1|you}} sure?\";'),(_binary 'en',_binary 'messages:confirmable-no',_binary 's:5:\"en:No\";'),(_binary 'en',_binary 'messages:confirmable-yes',_binary 's:6:\"en:Yes\";'),(_binary 'en',_binary 'messages:confirmdeletetext',_binary 's:233:\"en:You are about to delete a page along with all of its history.\nPlease confirm that you intend to do this, that you understand the consequences, and that you are doing this in accordance with [[{{MediaWiki:Policy-url}}|the policy]].\";'),(_binary 'en',_binary 'messages:confirmedit-preview-content',_binary 's:10:\"en:Content\";'),(_binary 'en',_binary 'messages:confirmedit-preview-description',_binary 's:509:\"en:The following table shows the list of lines on this page and whether it\'s a valid IP address or IP address range. If the line is a valid IP address or IP address range, it will be excluded from CAPTCHA checks but invalid lines will be ignored. An example of a valid IP address range would be: 69.208.0.0/16 which goes from 69.208.0.0 to 69.208.255.255. [https://www.mediawiki.org/wiki/Special:MyLanguage/Help:Range_blocks#Calculating_the_CIDR_suffix More information] about calculating an IP address range.\";'),(_binary 'en',_binary 'messages:confirmedit-preview-invalid',_binary 's:10:\"en:invalid\";'),(_binary 'en',_binary 'messages:confirmedit-preview-line',_binary 's:14:\"en:Line number\";'),(_binary 'en',_binary 'messages:confirmedit-preview-valid',_binary 's:8:\"en:valid\";'),(_binary 'en',_binary 'messages:confirmedit-preview-validity',_binary 's:11:\"en:Validity\";'),(_binary 'en',_binary 'messages:confirmedittext',_binary 's:158:\"en:You must confirm your email address before editing pages.\nPlease set and validate your email address through your [[Special:Preferences|user preferences]].\";'),(_binary 'en',_binary 'messages:confirmemail',_binary 's:24:\"en:Confirm email address\";'),(_binary 'en',_binary 'messages:confirmemail_body',_binary 's:400:\"en:Someone, probably you, from IP address $1,\nhas registered an account \"$2\" with this email address on {{SITENAME}}.\n\nTo confirm that this account really does belong to you and activate\nemail features on {{SITENAME}}, open this link in your browser:\n\n$3\n\nIf you did *not* register the account, follow this link\nto 