INSERT INTO `text` VALUES (1,_binary '<strong>MediaWiki has been installed.</strong>\n\nConsult the [https://www.mediawiki.org/wiki/Special:MyLanguage/Help:Contents User\'s Guide] for information on using the wiki software.\n\n== Getting started ==\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Configuration_settings Configuration settings list]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:FAQ MediaWiki FAQ]\n* [https://lists.wikimedia.org/postorius/lists/mediawiki-announce.lists.wikimedia.org/ MediaWiki release mailing list]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Localisation#Translation_resources Localise MediaWiki for your language]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Combating_spam Learn how to combat spam on your wiki]',_binary 'utf-8'),(2,_binary 'This is a test',_binary 'utf-8'),(3,_binary 'Hello. I am an admin on Kryptionary.\n\n==Tests==\n\n\'\'\'bold\'\'\'\n\n\'\'italic\'\'',_binary 'utf-8'),(4,_binary 'An obsolete [[IPA]] symbol that represented a voiced palatalized uvular plosive, which is now represented as [[ɢʲ]].',_binary 'utf-8'),(5,_binary 'Hello. I am an admin on Kryptionary.\n\n==Tests==\n\n\'\'\'bold\'\'\'\n\n\'\'italic\'\'\n\n==Pages I created==\n* [[ɢ̡]]',_binary 'utf-8'),(6,_binary 'Hello. I am an admin on Kryptionary.\n\n==Tests==\n\n\'\'\'bold\'\'\'\n\n\'\'italic\'\'\n\n==Pages I created==\n* [[ɢ̡]]\n===Tests===\n* [[Hello]]',_binary 'utf-8'),(7,_binary 'Welcome to Kryptionary! This wiki is a dictionary.\n\nConsult the [https://www.mediawiki.org/wiki/Special:MyLanguage/Help:Contents User\'s Guide] for information on using the wiki software.\n\n== Getting started ==\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Configuration_settings Configuration settings list]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:FAQ MediaWiki FAQ]\n* [https://lists.wikimedia.org/postorius/lists/mediawiki-announce.lists.wikimedia.org/ MediaWiki release mailing list]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Localisation#Translation_resources Localise MediaWiki for your language]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Combating_spam Learn how to combat spam on your wiki]',_binary 'utf-8'),(8,_binary 'English word meaning hi.',_binary 'utf-8'),(9,_binary 'Hello. I am an admin on Kryptionary.\n\n==Tests==\n\n\'\'\'bold\'\'\'\n\n\'\'italic\'\'\n\n==Pages I created==\n* [[ɢ̡]]\n* [[Hello]]',_binary 'utf-8'),(10,_binary 'Hello. I am an admin on Kryptionary.\n\n==Pages I created==\n* [[ɢ̡]]\n* [[Hello]]',_binary 'utf-8'),(11,_binary '[[English]] [[word]] meaning hi.',_binary 'utf-8'),(12,_binary '[[Welcome]] to Kryptionary! This [[wiki]] is a [[dictionary]].\n\nConsult the [https://www.mediawiki.org/wiki/Special:MyLanguage/Help:Contents User\'s Guide] for information on using the wiki software.\n\n== Getting started ==\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Configuration_settings Configuration settings list]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:FAQ MediaWiki FAQ]\n* [https://lists.wikimedia.org/postorius/lists/mediawiki-announce.lists.wikimedia.org/ MediaWiki release mailing list]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Localisation#Translation_resources Localise MediaWiki for your language]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Combating_spam Learn how to combat spam on your wiki]',_binary 'utf-8'),(13,_binary 'On Kryptionary, deletion is making pages only available to certain users such as [[Kryptionary:Administators|admins]]. Deletion is not permanent. Admins and other users are the ones that can delete and undelete pages.\n\nThere are two types of deletion:\n* For deletion with discussion, see the [[/with discussion]] subpage.\n* For deletion without discussion, see the [[/without discussion]] subpage.',_binary 'utf-8'),(14,_binary 'On Kryptionary, [[Kryptionary:Deletion|deletion]] in some cases can be done without discussion. The following reasons are valid:\n{|class=wikitable\n|-\n! Description\n! Notes\n|-\n| Made up content or hoaxes.\n| As long as it is clear that is it made up.\n|-\n| Absolute nonsense\n| As long as it is incomprehensible and<br>the page cannot be rewritten either.\n|}',_binary 'utf-8'),(15,_binary 'Hello. I am an admin on Kryptionary.\n\n==Pages I created==\n* [[Hello]]\n* [[ɢ̡]]\n* [[Kryptionary:Deletion]]\n* [[Kryptionary:Deletion/without discussion]]',_binary 'utf-8'),(16,_binary '#REDIRECT [[ɢ̡]]',_binary 'utf-8'),(17,_binary 'An obsolete [[IPA]] symbol that represented a voiced palatalized uvular plosive, which is now represented as ɢʲ.',_binary 'utf-8'),(18,_binary 'Hello. I am an admin on Kryptionary.\n\n==Pages I created==\n* [[Hello]]\n* [[ɢ̡]] and [[ɢʲ]]\n* [[Kryptionary:Deletion]] and [[Kryptionary:Deletion/without discussion]]',_binary 'utf-8'),(19,_binary 'On Kryptionary, [[Kryptionary:Deletion|deletion]] in some cases can be done without discussion. The following reasons are valid:\n{|class=wikitable\n|-\n! Description\n! Notes\n! Template\n|-\n| Made up content or hoaxes.\n| As long as it is clear that is it made up.\n| {{[[Template:Made up|Made up]]}}\n|-\n| Absolute nonsense\n| As long as it is incomprehensible and<br>the page cannot be rewritten either.\n| {{[[Template:Nonsense|Nonsense]]}}\n|-\n| Test pages\n|\n| {{[[Template:Test|Test]]}}\n|-\n| Pages created by blocked<br>or banned users.\n|\n| {{[[Template:Created by a blocked/banned user|Created by a blocked/banned user]]}}\n|-\n| Page that was deleted after<br>a discussion.\n| It does not matter whether the title<br>is the same, or if the title in on the<br>blacklist/is protected from creation,<br>the content has to be the same<br>or near the same, or on the<br>same subject.\n| {{[[Template:Page that was deleted after a discussion|Page that was deleted after a discussion]]}}\n|-\n| Deletion requested by the author\n|\n| {{[[Template:Deletion requested by the author|Deletion requested by the author]]}}\n|}',_binary 'utf-8'),(20,_binary '{|style=\"background: #e67c91; margin: auto;\"\n|-\n| This page might meet one of the criterions\n|-\n| for [[Kryptionary:Deletion/without discussion|deletion without discussion]] because\n|-\n| it is clearly made up or a hoax.\n|}',_binary 'utf-8'),(21,_binary 'Hello. I am an admin on Kryptionary.\n\n==Pages I created==\n* [[Hello]]\n* [[ɢ̡]] and [[ɢʲ]]\n* [[Kryptionary:Deletion]] and [[Kryptionary:Deletion/without discussion]]\n* [[Template:Made up]]',_binary 'utf-8'),(22,_binary '{|style=\"background: #e67c91; margin: auto;\"\n|-\n| This page might meet the criteria for\n|-\n| [[Kryptionary:Deletion/without discussion|deletion without discussion]] because it\n|-\n| is clearly made up or a hoax.\n|}',_binary 'utf-8'),(23,_binary 'An obsolete [[IPA]] symbol that represented a [[voiced palatalized uvular plosive]], which is now represented as ɢʲ.',_binary 'utf-8'),(24,_binary 'A consonant.',_binary 'utf-8'),(25,_binary 'Hello. I am an admin on Kryptionary.\n\n==Pages I created==\n* [[Hello]]\n* [[ɢ̡]] and [[ɢʲ]]\n* [[Kryptionary:Deletion]] and [[Kryptionary:Deletion/without discussion]]\n* [[Template:Made up]]\n* [[Voiced palatalized uvular plosive]]',_binary 'utf-8'),(26,_binary 'A [[consonant]].',_binary 'utf-8'),(27,_binary 'Hello. I am an admin on Kryptionary.\n\n==Pages I created==\n* [[Hello]]\n* [[ɢ̡]] and [[ɢʲ]]\n* [[Kryptionary:Deletion]] and [[Kryptionary:Deletion/without discussion]]\n* [[Template:Made up]]\n* [[Voiced palatalized uvular plosive]] and [[Voiced uvular plosive]]',_binary 'utf-8'),(28,_binary '<span style=\"font-family: Optima; font-size: 40px; float: left;\">DK</span>\n[[Welcome]] to Kryptionary! This [[wiki]] is a [[dictionary]].\n\nConsult the [https://www.mediawiki.org/wiki/Special:MyLanguage/Help:Contents User\'s Guide] for information on using the wiki software.\n\n== Getting started ==\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Configuration_settings Configuration settings list]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:FAQ MediaWiki FAQ]\n* [https://lists.wikimedia.org/postorius/lists/mediawiki-announce.lists.wikimedia.org/ MediaWiki release mailing list]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Localisation#Translation_resources Localise MediaWiki for your language]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Combating_spam Learn how to combat spam on your wiki]',_binary 'utf-8'),(29,_binary 'Do not.',_binary 'utf-8'),(30,_binary 'Hello. I am an admin on Kryptionary.\n\n==Pages I created==\n* [[Hello]]\n* [[ɢ̡]] and [[ɢʲ]]\n* [[Kryptionary:Deletion]] and [[Kryptionary:Deletion/without discussion]]\n* [[Template:Made up]]\n* [[Voiced palatalized uvular plosive]] and [[Voiced uvular plosive]]\n* [[Stop]]',_binary 'utf-8'),(31,_binary 'On Kryptionary, [[Kryptionary:Deletion|deletion]] in some cases can be done without discussion. The following reasons are valid:\n==General criteria==\nThe following criteria applies to every single page<!--, but some criteria exclude certain ones-->.\n\n===G1: Made up content or hoaxes===\nAs long as it is clear that is it made up.\n\nTemplate: {{[[Template:Made up|Made up]]}}\n\n===G2: Absolute nonsense===\nAs long as it is incomprehensible and<br>the page cannot be rewritten either.\n\nTemplate: {{[[Template:Nonsense|Nonsense]]}}\n\n===G3: Test pages===\nTemplate: {{[[Template:Test|Test]]}}\n\n===G4: Pages created by blocked or banned users===\nTemplate: {{[[Template:Created by a blocked/banned user|Created by a blocked/banned user]]}}\n\n===G5: Page that was deleted after a discussion.===\nIt does not matter whether the title is the same, or if the title in on the blacklist/is protected from creation, the content has to be the same or near the same, or on the same subject.\n\nTemplate: {{[[Template:Page that was deleted after a discussion|Page that was deleted after a discussion]]}}\n\n===G6: Deletion requested by the author===\n{{[[Template:Deletion requested by the author|Deletion requested by the author]]}}',_binary 'utf-8'),(32,_binary 'On Kryptionary, [[Kryptionary:Deletion|deletion]] in some cases can be done without discussion. The following reasons are valid:\n==General criteria==\nThe following criteria applies to every single page<!--, but some criteria exclude certain ones-->.\n\n===G1: Made up content or hoaxes===\nAs long as it is clear that is it made up.\n\nTemplate: {{[[Template:Made up|Made up]]}}\n\n===G2: Absolute nonsense===\nAs long as it is incomprehensible and<br>the page cannot be rewritten either.\n\nTemplate: {{[[Template:Nonsense|Nonsense]]}}\n\n===G3: Test pages===\nTemplate: {{[[Template:Test|Test]]}}\n\n===G4: Pages created by blocked or banned users===\nTemplate: {{[[Template:Created by a blocked/banned user|Created by a blocked/banned user]]}}\n\n===G5: Page that was deleted after a discussion.===\nIt does not matter whether the title is the same, or if the title in on the blacklist/is protected from creation, the content has to be the same or near the same, or on the same subject.\n\nTemplate: {{[[Template:Page that was deleted after a discussion|Page that was deleted after a discussion]]}}\n\n===G6: Deletion requested by the author===\n{{[[Template:Deletion requested by the author|Deletion requested by the author]]}}\n\n===G7: Deleting pages to move another page to the title===\nIn some cases, a page may need to be moved. However, in some cases, a page cannot be moved to the new title unless the following conditions are met:\n* The new page title is a redirect to the current title\n* The new page title has one revision',_binary 'utf-8'),(33,_binary 'On Kryptionary, [[Kryptionary:Deletion|deletion]] in some cases can be done without discussion. The following reasons are valid:\n==General criteria==\nThe following criteria applies to every single page<!--, but some criteria exclude certain ones-->.\n\n===G1: Made up content or hoaxes===\nAs long as it is clear that is it made up.\n\nTemplate: {{[[Template:Made up|Made up]]}}\n\n===G2: Absolute nonsense===\nAs long as it is incomprehensible and<br>the page cannot be rewritten either.\n\nTemplate: {{[[Template:Nonsense|Nonsense]]}}\n\n===G3: Test pages===\nTemplate: {{[[Template:Test|Test]]}}\n\n===G4: Pages created by blocked or banned users===\nTemplate: {{[[Template:Created by a blocked/banned user|Created by a blocked/banned user]]}}\n\n===G5: Page that was deleted after a discussion.===\nIt does not matter whether the title is the same, or if the title in on the blacklist/is protected from creation, the content has to be the same or near the same, or on the same subject.\n\nTemplate: {{[[Template:Page that was deleted after a discussion|Page that was deleted after a discussion]]}}\n\n===G6: Deletion requested by the author===\n{{[[Template:Deletion requested by the author|Deletion requested by the author]]}}\n\n===G7: Deleting pages to move another page to the title===\nIn some cases, a page may need to be moved. However, in some cases, a page cannot be moved to the new title unless the following conditions are met:\n* The new page title is a redirect to the current title\n* The new page title has one revision\n\n==Files==\nThe following criteria apply to files.\n\n===F1. Files with the same name of a Commons one===',_binary 'utf-8'),(34,_binary '[[File:Wikipedia-logo-v2.svg|right]]\nA wiki.',_binary 'utf-8'),(35,_binary 'Hello. I am an admin on Kryptionary.\n\n==Pages I created==\n* [[Hello]]\n* [[ɢ̡]] and [[ɢʲ]]\n* [[Kryptionary:Deletion]] and [[Kryptionary:Deletion/without discussion]]\n* [[Template:Made up]]\n* [[Voiced palatalized uvular plosive]] and [[Voiced uvular plosive]]\n* [[Stop]]\n* [[Wikipedia]]',_binary 'utf-8'),(36,_binary '#REDIRECT [[User:BodhiHarp]]',_binary 'utf-8'),(37,_binary '#REDIRECT [[Kryptionary:Administrators]]',_binary 'utf-8'),(38,_binary '==Pages I created==\n* [[Hello]]\n* [[ɢ̡]] and [[ɢʲ]]\n* [[Kryptionary:Deletion]] and [[Kryptionary:Deletion/without discussion]]\n* [[Template:Made up]]\n* [[Voiced palatalized uvular plosive]] and [[Voiced uvular plosive]]\n* [[Stop]]\n* [[Wikipedia]]',_binary 'utf-8'),(39,_binary '#REDIRECT [[Kryptionary:Administrators]]\n<small>Note: Please do not fix or change this redirect.</small>',_binary 'utf-8'),(40,_binary '#REDIRECT [[Kryptionary:Administrators]]\n<small>Note: Please do not fix, change, or delete this redirect.</small>',_binary 'utf-8');
